insert into `recipes` values('1','Dinner Omelet','Preheat oven to 375 degrees.\r\nBlend cottage cheese and half and half in blender, then add flour, eggs, and salt to taste.\r\nPour egg mixture into a greased 8x8 pan: bake about 20-25 minutes until golden.\r\nRemove from oven and spread with mustard, sprinkle with cheese and bacon.\r\nCut in squares and serve.','',null,'2006-07-22 23:25:07'),
 ('2','Pam\'s Teriyaki Chicken','Mix sugar and soy sauce together in frying pan on medium heat.\r\nAdd thighs and turn occasionally while cooking, until sauce thickens (20-30 minutes).','',null,'2006-07-22 23:49:15'),
 ('3','Hot Avocado and Crab','Preheat oven to 350 degrees.\r\nPeel, pit and chop avocado and stir in lemon juice.\r\nSprinkle with garlic salt and powder, and top with crab.\r\nMix all sauce ingredients and microwave until cheese is melted: stir. \r\nPour sauce over crab.\r\nBake 15 minutes (or in same oven with omelet and cook about 10-12 minutes).','',null,'2006-07-23 00:44:54'),
 ('4','Honey Lime Salad','Put fruits in salad bowl.\r\nStir dressing ingredients together  (warm in microwave if necessary) and mix with fruit.','',null,'2006-07-23 00:52:30'),
 ('5','Chicken Fajitas','Heat oil in skillet: cook chicken strips with lemon pepper until almost cooked through. \r\nAdd half the vinegar and continue cooking until caramelized.\r\nRemove chicken from skillet and add peppers, onion, and remaining vinegar to skillet.\r\nCook 1-2 minutes until crisp tender and then add the chicken back to skillet.\r\nStir in sour cream and divide skillet ingredients and cheese between warmed tortillas*.\r\nFold and enjoy!\r\n*To warm tortillas using microwave, put paper towels between each tortilla or fry them in a nonstick skillet, on each side, for just a minute to lightly brown (preferred).','',null,'2006-07-23 00:52:53'),
 ('6','Mustard Spinach Salad',null,null,null,'2006-07-23 00:53:07'),
 ('7','Salsa Cream Chips',null,null,null,'2006-07-23 00:53:25'),
 ('8','Simply Grilled Steak',null,null,null,'2006-07-23 00:53:36'),
 ('9','Creamy Garden Vegetable Salad','Mix washed veggies together: stir in dressing and top with cheese. ENJOY! \r\n\r\n','','','2006-07-23 00:53:53'),
 ('10','Garlic Parsley Onion Bread','Mix first 4 ingredients, and spread over bread.\r\nSprinkle cheese over top. Broil bread until top is golden brown and bubbly.\r\n		\r\n','','6','2006-07-23 00:54:10'),
 ('11','Spicy Fried Shrimp',null,null,null,'2006-07-23 00:54:22'),
 ('12','Kim\'s Tortellini Salad','','','6','2006-07-23 00:54:41'),
 ('13','Melon Fruit Salad',null,null,null,'2006-07-23 00:55:01'),
 ('14','Judy\'s Chili Bake',null,null,null,'2006-07-23 00:55:19'),
 ('15','Creamy Brocco-flower Salad',null,null,null,'2006-07-23 00:55:34'),
 ('16','Sour Cream Apricots',null,null,null,'2006-07-23 00:55:47'),
 ('17','Creamy Mashed Potatoes','Wash and cut potatoes into 4ths (peeling is optional)\r\nPut in saucepan and barely cover with water.\r\nBring to a boil: continue boiling until soft (about 20 minutes): drain.\r\nOr microwave about 5 minutes until potatoes are very soft.\r\nAdd butter, salt, and milk and mash all with masher, or electric mixer.\r\nEnjoy with the chicken on top or melted butter.','',null,'2006-07-23 00:56:24'),
 ('18','Cheesecake Berries','Make pudding according to package directions using one and one-half cups milk.\r\nStir in berries and let salad sit until berries are thawed.\r\n\r\n','','4','2006-07-23 01:00:10'),
 ('19','Pigs in a Blanket',null,null,null,'2006-07-23 01:00:21'),
 ('20','Cheesy Carrot Broccoli',null,null,null,'2006-07-23 01:00:38'),
 ('21','Peachy Yogurt','Mix together and chill.','','4','2006-07-23 01:00:48'),
 ('22','Lemon and Trout',null,null,null,'2006-07-23 01:01:03'),
 ('23','Rice and Cilantro',null,null,null,'2006-07-23 01:01:12'),
 ('24','Spinach Craisin Salad','Mix first 3 salad ingredients in salad bowl.	\r\nStir dressing ingredients together and pour over salad.\r\nTop with nuts and enjoy!\r\n	\r\n\r\n','','4','2006-07-23 01:01:24'),
 ('25','Summer Chicken Pasta',null,null,null,'2006-07-23 01:02:12'),
 ('26','Posh Squash',null,null,null,'2006-07-23 01:02:24'),
 ('27','Hard Roll n\' Strawberries',null,null,null,'2006-07-23 01:02:38'),
 ('28','BBQ Sauce Meatballs',null,null,null,'2006-07-23 01:02:48'),
 ('29','Cheese Sauce Potatoes',null,null,null,'2006-07-23 01:03:03'),
 ('30','Lettuce Layer Salad','Layer salad ingredients in the order listed in a 9 x 13 pan.\r\nMix dressing ingredients and spread over layers: cover tightly and refrigerate until ready to serve (15 minutes to several hours).\r\nTop with cheese and bacon just before serving.\r\n\r\n','','4-6','2006-07-23 01:03:14'),
 ('31','Chicken for Supper','Place chicken breasts in bottom of crock-pot sprayed with vegetable cooking spray.\r\nSeason well with garlic salt and pepper.\r\nCombine carrots, green beans, potatoes, soup, and sour cream: pour over chicken.\r\nCover and cook on LOW for 8-10 hours or on HIGH for 4-5 hours.\r\nWhen ready to serve, sprinkle cheese on top.','','4','2006-07-31 20:02:55'),
 ('32','Sweet Dinner Roll','Split dinner rolls.\r\nWhisk butter and honey together until well blended and serve with rolls.','','4','2006-07-31 20:06:56'),
 ('33','Cold Watermelon','','','4','2006-07-31 20:08:41'),
 ('34','Grilled Honey Salmon','Preheat BBQ grill.\r\nLay fish in a single layer on sprayed grill of BBQ.\r\nWarm honey, garlic and soy and drizzle over salmon while grilling-turn and drizzle on, or brush other side also.\r\nGrill with lid closed in between brushing with honey mixture, until cooked through.','',null,'2006-07-31 20:10:06'),
 ('35','Tiny Dill Potatoes','Put potatoes on a plate and microwave 2-5 minutes, until fork tender.\r\nStir in butter, dill and salt to taste.','','4','2006-07-31 20:11:15'),
 ('36','Raspberry Toss Salad','Put romaine in salad bowl.\r\nMicrowave fully cooked bacon for 30 seconds: cool and crumble over romaine.\r\nAdd crumbled feta and cashews to salad bowl.\r\nMix raspberries and dressing. Allow raspberries to thaw and then drizzle dressing (amount to taste) over salad just before serving.','',null,'2006-07-31 20:20:36'),
 ('38','Pork Pitas','Stir together the ham, tomato, onion, and cheese.\r\nMix dressing ingredients and stir with ham mixture.\r\nFill pita pockets and enjoy!','','4','2006-07-31 22:08:15'),
 ('39','Cottage Cheese Coconut Fruit Salad','Drain Pineapple: stir all together and chill until ready to Enjoy!','','4','2006-07-31 22:11:56'),
 ('40','Ants on a Log','Spread peanut butter on celery and dot with raisins.','',null,'2006-07-31 22:14:47'),
 ('41','Mandarin Pasta Salad','Chill dressing while you prepare and toss salad ingredients together.\r\nWhen ready to serve, toss chilled dressing with salad (all ingredients should be cool).\r\nSprinkle almonds on top and enjoy!\r\n*To toast-lay flat in shallow pan and stick in oven while pre-heating. Watch and stir occasionally, until lightly browned.','',null,'2006-07-31 22:16:33'),
 ('42','Sweet Skillet Tortillas','Divide jam between the six tortillas and spread down the middle of each one.\r\nSprinkle cheese on the tortillas.\r\nFold in top and bottom of tortilla and roll starting at one side.\r\nPlace tortilla packets, seam side down, in the skillet and cook over medium heat 3-4 minutes per side, or until browned.','','','2006-07-31 22:30:43'),
 ('43','Lemon Garlic Burgers','Prepare grill or broiler. \r\nCombine garlic and lemon juice.\r\nSeason patties with salt and pepper to taste.\r\nArrange patties on a grill or broiler pan.\r\nGrill 4 minutes and then turn and drizzle with half lemon mixture. \r\nGrill another 4 minutes or until cooked through.\r\nDrizzle with remaining lemon mixture. \r\nServe on buns with condiments of choice.','','4','2006-07-31 22:33:13'),
 ('44','Rich Dressing Toss','Combine dressing ingredients well.\r\nPut remaining ingredients in salad bowl and toss with dressing to taste.','',null,'2006-07-31 22:35:42'),
 ('45','Curly Fries','Spread fries out in single layer on cookie sheet.\r\nSprinkle well with garlic salt.\r\nCook as package directs stirring fries once and sprinkling with salt.\r\nPut fries under broiler for a couple minutes at the end to add crispness.','',null,'2006-07-31 22:41:10'),
 ('46','Sandy\'s Angel Chicken','Mix first four ingredients with one-half cup water until smooth.\r\nLay chicken in crock-pot; pour sauce over and cook on high 4 hours or on low about 8.','',null,'2006-08-14 21:24:02'),
 ('47','Buttered Rice with Parsley','Cook rice according to package directions. \r\nStir in butter, parsley, and salt and pepper to taste.','','','2006-08-14 21:26:04'),
 ('48','Apricot Glazed Chicken BBQ','Preheat barbecue.\r\nMix ingredients for glaze and brush on chicken.\r\nPut breasts on grill over medium high heat (gas BBQ) or 6 inches from charcoal.\r\nCook 15-20 minutes, turning 2-3 times and brushing with glaze often. (Chicken should be tender and juices run clear)','',null,'2006-08-24 17:48:22'),
 ('49','Grilled Spicy Corn','Mix butter with seasonings and a little salt.\r\nSpread butter mixture over ears and lay each ear on a 12-inch square of foil. \r\nRoll the foil tightly around the corn and crimp the ends shut. \r\nPlace the corn packets over medium-high heat on the grill and roast for 12-15 minutes, turning 2 to 3 times while they cook. \r\nCarefully unwrap the roasted ears and enjoy.','','4','2006-08-24 20:33:38'),
 ('50','Hickory Beans with Pineapple','Combine all and season with salt and pepper to taste.\r\nMicrowave covered 10 minutes (in a dish large enough so that it doesn\'t boil over).','','4','2006-08-24 20:37:29'),
 ('51','Carisa\'s Souffle','Preheat oven to 325 degrees.\r\nSpray an 8-inch dish and spread chilies on the bottom.\r\nCover chilies with half the cheese, all of the tomato, and egg.\r\nSeason with salt and pepper; sprinkle top with remaining cheese.\r\nBake about 35 minutes until \"set.\"\r\nEnjoy with your favorite salsa!','','4','2006-08-24 20:40:39'),
 ('52','Melon Berry Cream Salad','Combine fruit in a bowl. \r\nMix cream cheese, brown sugar and yogurt until smooth. \r\nStir sauce into fruit.','','','2006-08-24 23:16:14'),
 ('53','Broil Topped Scallops','Preheat oven to 450 F. \r\nSaute mushrooms and onion about 3 minutes in half the butter.\r\nStir in garlic and cook 30 seconds: remove from heat. \r\nStir in scallops, bread crumbs, parsley: season with salt and pepper to taste.\r\nPlace skillet ingredients in a sprayed 8-inch pan.\r\nMelt remaining butter and drizzle over top.\r\nBake 10 minutes and then broil for about 2 minutes until browned.','','4','2006-08-25 06:22:25'),
 ('54','Toasted English Muffins','Split 4 english muffins and toast the halves.\r\nSpread with butter and enjoy.','','4','2006-08-25 06:29:22'),
 ('55','Steamed Zucchini & Pepper','Lay zucchini slices on a plate: sprinkle with water and microwave 1-2 minutes. \r\nPut zucchini in serving bowl and stir in butter and pepper.','','4','2006-08-25 06:39:45'),
 ('56','Chicken Sesame Nuggets','Toast seeds in a nonstick skillet and stir these with chicken pieces in a bowl.\r\nPut oil in skillet and heat on medium: add chicken and stir-fry until no longer pink.\r\nMix all sauce ingredients thoroughly, and serve on the side, with the chicken.','','4','2006-08-29 21:22:03'),
 ('57','Tortellini Shrimp Salad','Cook tortellini according to package directions: drain and cool.\r\nCombine tortellini with remaining ingredients, toss gently and enjoy!','','4','2006-08-29 21:39:37'),
 ('58','Blueberry N\' Cream Salad','Dissolve gelatin in 1 cup boiling water.\r\nStir in cream cheese until it melts.\r\nStir in berries and pineapple (do not drain).\r\nWhip cream until stiff and fold into gelatin: refrigerate until set.','','6','2006-08-29 22:42:27'),
 ('59','Yummy Pork Sandwich','Preheat oven to 325∞F. \r\nRub roast with pepper and place in a shallow roasting pan.\r\nCook uncovered 35-40 minutes (about 25 minutes per lb)\r\nRemove from oven and let rest 10 minutes before slicing. \r\nLay bread open faced on the counter and layer with meat, veggies, and dressing.','* Cut this amount from a larger roast if necessary and freeze the rest.','6','2006-08-29 22:51:35'),
 ('60','Black-eye Peas with Rice','Heat a skillet over medium high: stir-fry bacon, onion, celery, and garlic for 2-3 minutes (add a little oil if needed). \r\nAdd the black-eyed peas, rice, bouillon, and 2 cups water.\r\nSeason with salt and pepper to taste and bring to a boil over high heat: cover pan, remove from heat and let stand about 5 minutes, until rice is tender.','','4','2006-08-29 23:04:43'),
 ('61','Cantaloupe','Cut and seed a small, well chilled cantaloupe into several slices and enjoy.','','4','2006-08-29 23:23:56'),
 ('62','Asparagus Fettuccine','Melt butter; add onions, garlic, almonds, and cook stirring for 3 minutes. \r\nAdd half and half, parsley, basil, Parmesan, and asparagus: heat through.\r\nSpoon sauce over pasta and serve. ','Tip: Yummy way to introduce small children to a less than favorite veggie!','4','2006-08-29 23:25:26'),
 ('63','Peach Muffin','Preheat oven to 375 degrees.\r\nMix all ingredients in the order given with water to make moist (about one-half cup).\r\nDrop dough into lightly greased muffin pan (fill 6-8 holes 2/3rds full)\r\nBake 12-15 minutes and enjoy warm with butter.','','4','2006-08-29 23:31:20'),
 ('64','Sweet Spring Mix Salad','Place lettuce and bacon in a salad bowl and dressing ingredients in a saucepan.\r\nBring dressing to a boil and simmer about 10 minutes, or until thickened to a syrup.\r\nRemove saucepan from heat and add one-fourth cup warm water.\r\nToss lettuce with dressing.','','4','2006-08-29 23:41:41'),
 ('65','Cool September Fruit','Put fruit in salad bowl.\r\nMix mayo and concentrate with a pinch of salt and paprika (optional).\r\nStir in cream and mix dressing with fruit: chill until ready to serve.\r\n\r\n\r\n','','4','2006-08-29 23:48:03'),
 ('66','Nena\'s Southwestern Cobb','Make dressing first and chill (at least 30 minutes, longer better) before serving.\r\nSeason chicken with salt and pepper and place in preheated oiled skillet.\r\nCook 5-10 minutes, stirring occasionally, until chicken is no longer pink in middle: cool.\r\nCool cooked eggs and slice.\r\nIn salad bowl layer romaine and then all other ingredients (besides dressing), as desired.\r\nDrizzle dressing on top and serve with tortilla chips.','','8','2006-08-29 23:48:11'),
 ('67','Tortilla Chips','','','4','2006-08-29 23:53:14'),
 ('68','Fresh Fruit Medley','Stir together and chill until ready to serve.','','4','2006-08-29 23:55:10'),
 ('69','American Burgers','Prepare grill while you combine first 3 ingredients: reserve one-fourth cup mixture.\r\nCombine meat, one-fourth cup mayo mixture, and breadcrumbs: salt and pepper to taste. Shape into 4 patties and place on a greased grill over hot coals about 6 inches from heat. Grill 3-4 minutes per side or to desired doneness.\r\nTop each patty with a cheese slice and continue grilling until cheese melts.\r\nSpread buns with remaining mayo mix: put a patty in each. \r\nTop with lettuce and tomato slices.','','4','2006-08-29 23:57:42'),
 ('70','Corn on the Grill','Soak corn (husks and all) for 15-60 minutes in a pan of water.\r\nRemove and stick on grill. \r\nBBQ covered 15-20 minutes, turning corn one-quarter turn each 5 minutes.\r\nHusks will be quite blackened-let cool 5 minutes, husk and enjoy with butter and salt!','','','2006-08-30 00:02:05'),
 ('71','2 Bean Salad','Mix the 2 beans and onion in salad bowl.\r\nMix dressing ingredients well and stir into the beans.\r\nRefrigerate at least 2 hours before serving.','','4','2006-08-30 00:03:23'),
 ('72','Tangy Grilled Steak','Preheat barbecue (or broiler).\r\nCombine all ingredients, except meat, and microwave 30 seconds.\r\nSpread sauce onto both sides of beef steaks.\r\nPlace steaks on grid over medium high heat.\r\nGrill steaks 12-14 minutes-more or less according to thickness of meat and desired doneness--turning occasionally.','','4','2006-09-04 13:43:39'),
 ('73','Two Cheese Potatoes','Wash potatoes and slice into half-inch thick circles: put in the bottom of casserole dish.\r\nPeel onion and slice into rings: lay on top of potatoes and season with salt and pepper.\r\nSprinkle cheeses over onion, and then drizzle butter over all.\r\nCover and microwave 5 minutes, or until potatoes are as soft as you like.','','4','2006-09-04 13:48:37'),
 ('74','Fresh Spinach Salad','Place salad ingredients in a salad bowl in the order given.\r\nPour dressing over spinach mixture and toss well to coat.\r\nChill until ready to serve.','','4','2006-09-04 13:50:30'),
 ('75','Chicken Rice Salad','Make rice: cool completely while you stir-fry chicken in skillet with a little water and oil until no longer pink in the middle: cut into small pieces: cool.\r\nMix rice with chicken, onion, bell pepper, pea pods, and avocado.\r\nWhisk all dressing ingredients well and stir into salad (amount to taste as you prefer).\r\nChill 2-8 hours; top with pecans and enjoy this whole meal salad!','','4','2006-09-04 13:55:10'),
 ('76','Almond Squares','Preheat oven to 350 degrees.\r\nCream butter and sugar.\r\nAdd eggs, salt and extract: mix well.\r\nAdd and mix in flour.\r\nPour into 8-inch pan; sprinkle with almonds and bake 25 minutes or until golden brown.','','4','2006-09-04 14:50:47'),
 ('77','Pork Burrito','Brown pork strips in medium hot skillet.\r\nPeel onion and cut into 4: cut tomato into 4. \r\nPut all sauce ingredients in blender and puree: add to browned meat in skillet.\r\nCover and simmer 10 minutes.\r\nSpread tortillas with refried beans and sprinkle with cheese.\r\nDivide pork/sauce amongst all tortillas: roll up and put in microwave safe dish.\r\nMicrowave 1 minute and ENJOY!','','4','2006-09-04 14:53:30'),
 ('78','Melon Raspberry Burst','Pure\' raspberries with syrup in a blender.\r\nMix this with the melon chunks.','','4','2006-09-04 14:56:39'),
 ('79','Chips and Bean Dip','','','4','2006-09-04 14:58:42'),
 ('80','Orzo and Beef','Mix one-fourth cup water, broth, pasta, corn and chilies in saucepan: heat to boiling then turn down, cover and simmer 10 minutes.\r\nBrown beef and pepper in skillet with oil.\r\nMix beef with pasta mixture, stir in cilantro and enjoy!','','','2006-09-04 15:00:59'),
 ('81','Mandarin Salad','Toss salad ingredients in a bowl.\r\nCombine dressing ingredients and spoon over salad.','','4','2006-09-04 15:03:33'),
 ('82','Simplest Biscuits','Preheat oven to 425 degrees.\r\nMix all ingredients in the order given.\r\nDrop by spoonfuls (8) onto lightly greased cookie sheet.\r\nBake 8-10 minutes, or until golden brown. Serve warm with butter.','','','2006-09-04 15:05:51'),
 ('83','Baked or Grilled Halibut','Preheat oven to 350 degrees, or BBQ grill.\r\nLay fish in a single layer in a lightly greased pan or on sprayed grill of BBQ.\r\nMix butter, lemon juice and salt, and drizzle over fish-half per side if barbecuing.\r\nBake 20 minutes, or grill (close lid) on each side until cooked through.','','4','2006-09-04 15:06:58'),
 ('84','Lemon Flavor Rice','In a saucepan bring 2 cups water and bouillon to a boil.\r\nStir in rice: reduce heat to low, cover pan and simmer 20 minutes.\r\nRemove from heat and let stand 5 minutes, covered.\r\nStir in garlic and lemon peel (to taste) and enjoy.','','4','2006-09-04 15:07:53'),
 ('85','Best Caesar','Put salad greens in bowl, or divide amongst salad plates.\r\nWhisk dressing ingredients together until well combined.\r\nDrizzle salad with dressing to taste: top with croutons and cheese.','','4','2006-09-04 15:09:11'),
 ('86','Italian Garlic Chicken','Preheat oven to 350 degrees.\r\nCombine all ingredients, except chicken, in a bowl, along with pepper to taste.\r\nSpread seasoned butter over outside of chicken.\r\nPlace chicken, breast side down, in a baking dish, and cook 35 minutes. \r\nTurn chicken breast side up: bake 25-35 minutes, basting occasionally with pan juices. \r\n\r\n','','6','2006-09-08 20:29:24'),
 ('87','Broco-Noodle Side','Combine first 4 ingredients set aside.\r\nCook noodles according to package: drain.\r\nRinse broccoli, put it in a bowl and microwave 3-4 minutes until tender.\r\nToss broccoli with noodles and sauce.\r\n','','4','2006-09-08 20:46:00'),
 ('88','Broccoli Cheese Quiche','Preheat oven to 350 degrees.\r\nBlend until smooth, all but last three ingredients; season with salt and pepper.\r\nRinse broccoli and put in microwave for 1 minute.\r\nStir blended mixture with broccoli, cheese and bacon.\r\nPour into greased 8-inch baking dish and bake 30-35 minutes or until “set.”\r\n','','4','2006-09-09 10:46:22'),
 ('89','PB Rice Cakes','Divide and spread peanut butter on rice cakes and sprinkle with raisins.\r\n\r\n','','4','2006-09-09 20:30:08'),
 ('90','Watermelon Slice','','About 5 lbs of watermelon will give you 4 large slices.\r\n\r\n\r\n','4','2006-09-09 20:36:39'),
 ('91','blah','Preheat oven to 350 degrees.\r\nCombine all ingredients, except chicken, in a bowl, along with pepper to taste.\r\nSpread seasoned butter over outside of chicken.\r\nPlace chicken, breast side down, in a baking dish, and cook 35 minutes. \r\nTurn chicken breast side up: bake 25-35 minutes, basting occasionally with pan juices. \r\n\r\n','','','2006-09-09 21:24:10'),
 ('92','London Broil','Put butter, and onion in small dish: microwave 30 seconds, or until onion is tender.\r\nStir oil, lemon, and garlic together: brush half over top of meat: salt and pepper to taste.\r\nBroil 2-3 inches from heat about 5 minutes.\r\nTurn meat, brush with remaining oil mix and cook another 5 minutes.\r\nPour onion/butter mix over meat, cut thin slices across grain of meat and enjoy!\r\n','','4','2006-09-11 21:09:39'),
 ('93','Tasty Brown Rice','Melt butter in a skillet and add garlic, scallions, and rice: sauté, stirring frequently 3-4 minutes until rice begins to crackle. \r\nStir in 2 cups of water and dill.\r\nBring to a boil, reduce heat, cover skillet, and simmer 45 minutes. \r\nRemove from heat and stir in Parmesan until melted.\r\n\r\n','','4','2006-09-11 21:09:49'),
 ('94','Chinese Cabbage Salad','Chop green onions and add them and coleslaw to salad bowl.\r\nAdd crushed ramen noodles (reserve flavor packet for dressing).\r\nMix all dressing ingredients together and pour over salad.\r\nToss and refrigerate until ready to serve (can be overnight)\r\nStir in almonds just before serving.\r\n','','','2006-09-11 21:09:59'),
 ('95','Fiesta Soup','Brown ground beef with onion.\r\nPut one-half cup water in a saucepan with browned beef and all ingredients but chips.\r\nSimmer 15 minutes (or more) and enjoy topped with corn chips.\r\n\r\n','','8','2006-09-11 21:10:07'),
 ('96','Avocado Quesadilla Sandwich','Preheat  broiler.\r\nRemove skin from avocado, mash with sour cream and spread over half of the tortillas. Sprinkle the scallions and jack cheese over the avocado: cover each with a tortilla.\r\nPlace tortilla sandwiches on broiler pan and cook for two minutes.\r\nCarefully turn and cook for two more minutes.\r\nCut each quesadilla into 6 pieces and serve with salsa.\r\n\r\n','','4','2006-09-11 21:10:56'),
 ('97','Berry Medley','Let berries thaw about 10 minutes before stirring with peach and pear.\r\nLet sit on counter until berries are thawed completely.\r\n\r\n','','4','2006-09-11 21:11:06'),
 ('98','Dijon Mustard Kabobs','Combine all ingredients but pork.\r\nPour over meat and marinate in refrigerator 6-24 hours.\r\nPreheat broiler or prepare grill.\r\nRemove pork from marinade and thread pork cubes onto skewers. (Note: If using wooden skewers, soak skewers in water 1 hour before using.)\r\nBroil or grill kabobs about 4 inches from heat source 8-10 minutes, turning and basting with marinade occasionally, until nicely browned.\r\n\r\n','','4','2006-09-11 21:11:33'),
 ('99','Creamy Cheese Potatoes','Wash and prick potatoes and microwave 3-4 minutes, until barely tender.\r\nSlice potatoes into quarter-inch circles: lay in an 8x8 dish: sprinkle with salt and pepper. \r\nPeel onion and slice rings over top of potato slices.\r\nMelt butter in saucepan, whisk in flour, and a sprinkle of salt and pepper, until bubbly.\r\nAdd milk and cook, stirring often, until mixture starts to thicken.\r\nAdd cheese and stir until it melts.\r\nPour over potato/onion and microwave 2 minutes.\r\n','','4','2006-09-11 21:11:42'),
 ('100','Sweet Peas Salad','Put sugar in one cup boiling water: stir and add peas.\r\nLet peas soak 2 minutes and then drain well.\r\nPut lettuce in a bowl, top with peas and serve with dressing.\r\n\r\n','','4','2006-09-11 21:11:52'),
 ('101','Italian Vegetable Pasta Salad','Cook pasta according to package directions: drain well.\r\nPut vegetables in a bowl and microwave 3-4 minutes, or until completely thawed.\r\nCut chicken into bite-sized pieces and mix with vegetables, tomato, and pasta.\r\nBlend dressing ingredients with salt to taste, and toss it with pasta mixture.\r\nCover and chill before serving.\r\n','','','2006-09-11 21:12:41'),
 ('102','Teriyaki Salmon','Combine soy, oil and sugar in small bowl.\r\nPreheat grill (or broiler) and place fish on it.\r\nBrush soy mixture on fish and grill (or broil) about 5 minutes.\r\nTurn and brush mixture on other side: cook 5-6 minutes until fish is opaque.\r\nSquirt fish with juice squeezed from lemon and serve.\r\n','','4','2006-09-15 16:01:22'),
 ('103','Oriental Rice','Combine ginger and olive oil with 2 cups water in saucepan: bring to a boil.\r\nAdd rice: stir and return to a boil: lower heat, cover and simmer 5 minutes. \r\nTurn off heat: stir, and let stand covered 5 minutes.\r\nStir in soy sauce and fluff with fork.\r\n','','4','2006-09-15 18:01:13'),
 ('104','Spinach and Swiss Salad','Put salad ingredients in a bowl in the order given.\r\nPour dressing over salad (desired amount) and chill until ready to serve.','*Optional: mushrooms are a nice addition to this salad\r\n','4','2006-09-15 18:10:15'),
 ('105','Gumbo Sandwich','Brown beef and onion until thoroughly cooked.\r\nStir in ketchup, mustard and sugar.\r\nAdd soup and heat to a simmer.\r\nServe on toasted (optional) buns.\r\n\r\n','','4','2006-09-16 15:14:42'),
 ('106','Broco-Noodle Soup','Combine first 4 ingredients set aside.\r\nCook noodles according to package: drain.\r\nRinse broccoli, put it in a bowl and microwave 3-4 minutes until tender.\r\nToss broccoli with noodles and sauce.\r\n','','4','2006-09-16 15:30:44'),
 ('107','Crunchy Dills','Chill and serve one crunchy dill pickle with each sandwich\r\n\r\n','','4','2006-09-16 15:45:24'),
 ('108','Western Tomato Soup','Cook bacon until crisp: remove bacon and crumble.\r\nSaute celery, onion and green pepper in bacon fat until limp, but not brown.\r\nAdd flour and cook 2 minutes, stirring occasionally.\r\nCombine milk, tomato soup, stewed tomatoes, and tomato juice in saucepan: heat, stirring until smooth.\r\nCombine all ingredients in the saucepan, except bacon.\r\nHeat and stir until slightly thickened: garnish each bowl of soup with crumbled bacon.\r\n','','4','2006-09-16 15:46:51'),
 ('109','Guacomole Veggie Wrap','Lay tortillas out and spread guacamole over one side.\r\nCover with remaining ingredients.\r\nFold tortillas and lay them on a plate. \r\nCover lightly (such as with wax paper): microwave 1 minute (more or less), until warm.\r\n\r\n','','4','2006-09-16 15:56:43'),
 ('110','Sweet Blues','Wash berries and sprinkle with sugar.\r\nChill until ready to serve.\r\n','','4','2006-09-16 16:04:42'),
 ('111','Slightly Sweet BBQ Chicken','Preheat barbecue grill to medium temperature (or use broiler).\r\nMix oil and syrup together.\r\nPlace chicken, bone side down over direct heat: brush with oil/syrup mix and salt to taste.\r\nClose cover and cook about 10 minutes.\r\nTurn, brush again and cook another 10 minutes or until juices run clear. \r\n\r\n','','4','2006-09-16 16:06:25'),
 ('112','Broccoli Stuffing Casserole','Preheat oven to 350 degrees.\r\nRinse broccoli and microwave 1 minute.\r\nBlend soup and sour cream and then stir in flour, carrot, the broccoli, and salt and pepper to taste: put in an 8-inch dish.\r\nMix stuffing with butter and spread over top of veggies.\r\nBake 30-35 minutes.\r\n','','4','2006-09-16 16:22:40'),
 ('113','Banana-Pineapple-Peanut Delight','Cut bananas and mix with pineapple and nuts.\r\nHeat first 4 dressing ingredients in a saucepan, stirring constantly, until thickens: cool.\r\nStir in yogurt and toss dressing with fruit and nuts; chill until ready to enjoy.\r\n','','6','2006-09-16 16:28:56'),
 ('114','Swiss Steak','Heat oil on medium high heat in large skillet\r\nStir together flour, salt and pepper: sprinkle this over steak and pound into both sides.\r\nCut meat into 4 pieces and brown both sides in hot oil.\r\nAdd 2 Tbsp water, cover and simmer about 30 minutes. (Add more water if necessary as meat cooks)\r\nMix sauce ingredients; salt and pepper to taste.\r\nAdd sauce to skillet, cover and simmer 30 minutes more.\r\n\r\n','','4','2006-09-16 16:35:34'),
 ('115','Sesame Cauliflower','To toast seeds, spread out on a shallow pan and put in oven as it heats to 375 degrees.\r\nStir often and remove seeds when golden brown. (Leave oven on)\r\nRinse cauliflower, put in a bowl and microwave 3-5 minutes until tender.\r\nMix sauce ingredients and pour over cauliflower.\r\nBake 15 minutes.\r\n','','4','2006-09-16 16:41:16'),
 ('116','Creamy Cucumber Salad','Rub toast with a little olive oil and sprinkle with garlic powder (pantry items).\r\nAdd vegetables to salad bowl; stir in dressing and crumble bread over top.\r\n\r\n','*Optional: Red bell pepper is a good addition to this salad.	\r\n','4','2006-09-16 16:44:41'),
 ('117','Taco Pasta','Cook pasta according to package directions. \r\nCombine beef, taco seasoning, garlic and oil in large, pre-heated skillet.\r\nStir-fry 1-2 minutes on medium high heat, browning all sides.\r\nAdd pasta, salsa, beans and 1/2 cup water to the beef; cook 4-5 minutes.\r\n','','4','2006-09-18 09:17:45'),
 ('118','Delicious Poppy Seed Salad','Put romaine and carrot in salad bowl.\r\nShake or blend dressing ingredients and toss with salad or serve on the side.\r\n\r\n','','4','2006-09-18 09:29:12'),
 ('119','Garlic French Bread','Combine butter and garlic and spread over bread.\r\nPut bread on shallow pan, buttered side up.\r\nSprinkle bread with Parmesan and broil 1-2 minutes, or until top is golden.\r\n\r\n','','4','2006-09-18 09:41:00'),
 ('120','Creamy Potato Cheese Soup','Rinse diced potatoes, cover and microwave 2-3 minutes until barely tender.\r\nMelt butter in saucepan and whisk in flour, salt, sugar, and pepper until well blended. Add milk and heat to a simmer, stirring occasionally.\r\nStir in onion, cover and simmer on low 5 minutes (stir bottom every minute). \r\nStir in cheese until melted and then potatoes.\r\nSimmer, stirring occasionally 10-15 minutes.\r\nStir in parsley and enjoy!\r\n','','4','2006-09-18 09:46:04'),
 ('121','Baked Tomato and Cheese','Preheat oven to 400 degrees.\r\nButter bread slices on one side and place on lightly greased baking sheet.\r\nTop each with one slice cheese, and one slice tomato.\r\nSalt and pepper to taste and top tomato with another slice of cheese.\r\nBake 15 to 20 minutes. Cool before serving.\r\n\r\n','','4','2006-09-18 09:54:33'),
 ('122','Peach Nectar Salad','Put nectar and cornstarch in small saucepan over medium heat: whisk until thickens: remove from heat: cool.\r\nAdd peaches and banana to nectar.\r\nRefrigerate until ready to serve.\r\n','','4','2006-09-18 10:00:45'),
 ('123','Broccoli and Scallops','Preheat oven to 425°F. \r\nCook rigatoni according to package direction: drain.\r\nWhile pasta is cooking microwave rinsed broccoli 2-3 minutes.\r\nStir in butter, and salt and pepper to taste.\r\nAdd broccoli to rigatoni and mix thoroughly. Set aside. \r\nArrange scallops in a lightly oiled baking dish.\r\nBake scallops 4 minutes: remove dish from oven and cover with pasta mix. \r\nSprinkle with both cheeses and bake an additional 10 minutes.\r\n\r\n','','4','2006-09-18 10:04:48'),
 ('124','Green and Gold Sauté','Heat oil in skillet over medium high.\r\nSauté the two squash and onions one minute, stirring. \r\nAdd one-quarter cup water and bouillon: salt and pepper to taste.\r\nContinue to sauté 2-3 minutes, until squash is tender and liquid evaporated.\r\n','','4','2006-09-18 10:10:17'),
 ('125','End of Season Melon','Put fruit in salad bowl.\r\nStir dressing ingredients together (warm honey if necessary): mix with fruit.\r\n\r\n','','4','2006-09-18 10:15:07'),
 ('126','Breaded Turkey Breasts','Combine breadcrumbs with parmesan and salt and pepper to taste. \r\nBarely rinse breasts and then dredge turkey in breadcrumbs, pressing lightly. \r\nHeat oil in skillet over medium high and sauté onion and garlic 1 minute.\r\nAdd turkey and continue to cook 4-5 minutes per side or until golden. \r\n\r\n','','4','2006-09-18 10:21:07'),
 ('127','Stuffing Spin Balls','Preheat oven to 350°F.\r\nCombine all ingredients and salt and pepper to taste.\r\nShape into 8 small balls and transfer to baking sheet.\r\nBake 25 minutes until cooked through. \r\n','Great way to introduce kids to the stuff that makes Popeye strong!','4','2006-09-18 10:26:28'),
 ('128','Creamy Strawberries','Blend (or mash) cottage cheese, vanilla, and honey until smooth.\r\nServe sauce over strawberries.\r\n','','4','2006-09-18 12:24:40'),
 ('129','Breakfast Pizza','Preheat oven to 350 degrees.\r\nMake gravy according to package directions and pour over boboli.\r\nScramble eggs and top gravy with the eggs, bacon, sausage, and pepper.\r\nSprinkle cheese over and bake 20 minutes.\r\n','','4','2006-09-18 12:27:30'),
 ('130','Avocado Bean Salsa','Mix all ingredients but avocado and chips, and season with salt to taste.\r\nRefrigerate at least 30 minutes.\r\nPeel and pit avocado: chop and add to salsa just before serving with chips.\r\n	\r\n','','6','2006-09-18 12:37:35'),
 ('131','Chilled Applesauce','About 20 oz will serve a family of 4.','','4','2006-09-18 12:48:56'),
 ('132','Garden Ravioli Soup','In large saucepan brown sausage, partly drain.\r\nAdd garlic and onion to saucepan with sausage: sauté, stirring, 1-2 minutes.\r\nAdd broth, seasoning, carrot, and tomatoes, and bring to a boil.\r\nAdd tortellini, reduce heat and simmer 15 minutes, stirring occasionally.\r\nAdd spinach at 5 minutes remaining.\r\nDish up soup and sprinkle each bowl with cheese—Enjoy!\r\n','','6','2006-09-18 14:56:25'),
 ('133','Garden Parsley Onion Bread','Mix first 4 ingredients, and spread over bread.\r\nSprinkle cheese over top. Broil bread until top is golden brown and bubbly.\r\n		\r\n','','4','2006-09-18 15:08:51'),
 ('134','Simple Waldorf','Combine apples, celery and nuts.\r\nMix mayonnaise and sugar and stir with apple/celery/nut mix.\r\n','','4','2006-09-18 15:17:46'),
 ('135','Zesty Broiled Halibut','Preheat  broiler.\r\nLightly spray broiler pan; put fish on it and brush with part of the dressing.\r\nBroil close to element 5-8 minutes; brush with more dressing and turn.\r\nBroil until cooked through (5-8 minutes) basting with remaining dressing.\r\n\r\n','','4','2006-09-18 15:22:49'),
 ('136','Herbed Vegetables','Whisk cornstarch and one-half cup cold water in a saucepan. \r\nAdd bouillon and bring to a boil stirring well.\r\nAdd other ingredients, cover and simmer 15-20 minutes until tender.\r\n\r\n','','4','2006-09-18 15:35:21'),
 ('137','Best Bleu Cheese Dressing Salad','Put greens in a salad bowl.\r\nCrumble bleu cheese into a different bowl and whisk with the buttermilk.\r\nAdd all other dressing ingredients and stir well: chill.\r\nPour over greens just before serving.\r\n','','4','2006-09-18 15:39:29'),
 ('138','Favorite Taco Casserole','Preheat oven to 350 degrees.\r\nBrown beef with onion and then stir in soup and taco seasoning.\r\nLine bottom and sides of  a 9x13 with 5 tortillas (tear last one to make it fit).\r\nSpread beef mixture over tortillas in pan.\r\nTop beef with remaining tortillas, tearing to completely cover top.\r\nPour alfredo over tortilla top: sprinkle cheese over alfredo.\r\nCover and bake 15 minutes: uncover and bake 10 minutes more.\r\n\r\n\r\n','','6-8','2006-09-18 16:21:13'),
 ('139','Cheese Topped Refried Beans','Mix beans, garlic, milk, and salt and pepper to taste.\r\nSprinkle cheese on top and heat covered in microwave 1-2 minutes until hot.\r\n\r\n','','4-6','2006-09-18 16:37:00'),
 ('140','Raspberry Spinach Salad','Put salad ingredients in a bowl in the order listed.\r\nMix dressing ingredients with 1 Tbsp water.\r\nDrizzle over salad just before serving.\r\n\r\n','','4','2006-09-18 16:39:59'),
 ('141','Stove Top Chicken and Rice','Spray surface of skillet with cooking spray and stir-fry chicken until brown. \r\nAdd 2 cups water, and remaining ingredients to skillet along with the chicken.\r\nBring to a boil, stir well and then reduce heat, cover and simmer 20-25 minutes or until rice and vegetables are tender. \r\nSeason with pepper if desired.\r\n','','4','2006-09-18 23:14:21'),
 ('142','Crumby Bananas','Peel and cut each banana into four pieces.\r\nRoll in lemon juice and then in crumbs.\r\n\r\n','','4','2006-09-19 08:39:00'),
 ('143','Brown Sugar Muffin','Preheat oven to 375 degrees F.\r\nMix all ingredients by hand in the order listed.\r\nLine a muffin pan with muffin papers, or grease each cup.\r\nFill 8 cups with batter, and bake 12-14 minutes, until toothpick inserted in center of one of the muffins comes out clean.   \r\nENJOY warm with your favorite spread!\r\n\r\n','','4','2006-09-19 08:43:30'),
 ('144','Sirloin Garlic Linguine','Cook pasta according to package directions. While it cooks--\r\nHeat oil in skillet: add beef and garlic and stir-fry until beef is barely browned.   \r\nAdd pepper strips: stir-fry 3 minutes (more or less until as soft as you like).\r\nAdd basil and toss.\r\nPlace pasta on platter; spoon beef mixture on top.\r\nSprinkle with cheese.\r\n\r\n','','4','2006-09-19 08:49:35'),
 ('145','Cheesy Asparagus and Tomatoes','Cook asparagus in boiling water until just tender: drain.\r\nPut asparagus in casserole dish and top with cheese and tomato.\r\nMicrowave 1 minute, top with crushed chips and microwave 30 seconds.\r\n','','4','2006-09-19 08:59:37'),
 ('146','Lemon Pudding Salad','Whisk lemon pudding 2 minutes with 1¾ cup milk or water.\r\nStir in oranges and strawberries, and then fold in whipped cream.\r\n\r\n\r\n','','6','2006-09-19 09:07:25'),
 ('147','Chicken Ziti','Preheat oven to 325°F.\r\nPartially cook ziti in boiling water for 5 minutes: drain completely.\r\nMicrowave chicken in 8x8 dish, covered, 3-5 minutes.\r\nSeason with salt and pepper.\r\nMix sauce, mozzarella, and ziti: pour over chicken; sprinkle with Parmesan.\r\nBake 30 minutes (with shortbread okay) until chicken is cooked through.\r\n\r\n','','4-6','2006-09-19 18:00:44'),
 ('148','Broccoli Zucchini Pepper Dish','Rinse broccoli and lay on a plate: microwave 1-2 minutes, until barely tender.\r\nStir broccoli with zucchini and bell pepper, and toss all with dressing.\r\nMarinate in dressing 30 minutes and serve at room temperature or chilled.\r\n\r\n','','4-6','2006-09-19 18:07:34'),
 ('149','Sweet Shortbread','Preheat oven to 325°F.\r\nCombine butter, brown sugar and vanilla: beat with electric mixer until fluffy.\r\nAdd 1 Tbsp water, and flour, one-fourth cup at a time, until dough is stiff.\r\nKnead by hand 1 minute. \r\nPress dough into the bottom of an 8-inch pan.\r\nPierce dough all over with a fork and bake 40-45 minutes or until golden.\r\nCool slightly before cutting. \r\n\r\n\r\n','','','2006-09-19 18:31:07'),
 ('150','Chilies Omelet','Preheat oven to 400 degrees.\r\nCombine flour, baking powder, and salt: stir with beaten eggs.\r\nStir in remaining ingredients and pour into sprayed 8-inch pan.\r\nBake 15 minute; reduce heat to 325 degrees and bake another 35 minutes.\r\n\r\n','','','2006-09-19 18:49:03'),
 ('151','Cheesecake Berry','Make pudding according to package directions using 1 1/2 cups milk.\r\nStir in berries and let salad sit until berries are thawed.\r\n\r\n','','','2006-09-19 18:54:26'),
 ('152','Almond & Greens Salad','Put all salad ingredients in a bowl in the order given.\r\nToss dressing with salad just before serving.\r\n','','4-6','2006-09-19 19:01:56'),
 ('153','Pineapple Glazed Ham','Preheat oven to 325 degrees.\r\nPut ham in roasting pan and bake about 50 minutes.\r\nMix glaze ingredients in a saucepan; bring to a boil and stir one minute.\r\nPull ham from oven and score top by making diagonal cuts.\r\nPour glaze over the top; return ham to oven and bake another 30 minutes.\r\n','','8','2006-09-19 19:10:36'),
 ('154','Pineapple Stuffing','Preheat oven to 350°F.\r\nBeat eggs in large bowl: Stir in remaining ingredients, except bread. \r\nAdd bread pieces and mixwell: pour into a buttered 8x8 dish.\r\nBake 40-45 minutes (a little longer if using 325 degree oven with ham)\r\n		\r\n','','','2006-09-19 19:55:59'),
 ('155','Cranberry Cherry Salad','Dissolve gelatin and sugar in 1 cup boiling water.\r\nAdd 1 cup chopped ice and stir until it melts.\r\nAdd cranberry sauce and fruit to gelatin and stir well.\r\nChill 15 minutes or until set: cover if refrigerating longer.\r\n','','6','2006-09-19 20:07:57'),
 ('156','Stuffed French Bread','Slightly beat egg and stir in all other ingredients, except bread.\r\nScoop out bread in pieces, leaving crusts whole: stir bread pieces with egg.\r\nSpoon into bottom half of baguette crust: cover with hallowed out upper half.\r\nCover bread with plastic wrap and refrigerate 1 hour.\r\nPreheat oven to 375 degrees. \r\nRemove bread from plastic and place on a baking sheet. \r\nBake 5 minutes and then turn and bake another 5 minutes or until crust is no longer soggy. Slice and ENJOY! \r\n\r\n','','4','2006-09-20 10:33:11'),
 ('157','Baked Beans','Preheat oven to 300 degrees.\r\nBrown and drain sausage: add all other ingredients to sausage.\r\nBake 3 hours, or microwave (covered) 10 minutes.\r\n','','6','2006-09-20 10:48:33'),
 ('158','Italian Vegetable Beef Soup','Brown beef and garlic in medium hot skillet.\r\nAdd pepper and salt to taste.\r\nStir 3 cups water, bouillon, tomatoes and carrots into skillet; bring to a boil, reduce heat to low and simmer, uncovered, 10 minutes.\r\nStir in beans and zucchini; continue to cook 3-4 minutes.\r\n\r\n','','4','2006-09-20 11:10:34'),
 ('159','Lettuce Cheese Bacon Salad','Put all salad ingredients in a bowl in the order given.\r\nMix dressing ingredients well and serve on the side with the salad.\r\n\r\n','','4-6','2006-09-20 12:45:25'),
 ('160','Sweet Cheese Tortilla','Top tortillas with apple slices and cheese. \r\nFold tortilla in half and microwave 20 seconds, or until cheese melts. \r\n\r\n','','4','2006-09-20 12:56:46'),
 ('161','Marinated Pork Ribs','Whisk sauce ingredients; microwave, stirring occasionally, until thickens.\r\nCover pork with sauce: refrigerate (covered) several hours (even overnight).\r\nPut ribs onto broiler pan, reserving marinade. \r\nBroil 15-20 minutes 4-6 inches from element, turning once and basting with marinade (Throw out any remaining marinade after ribs are cooked)\r\n\r\n','','4','2006-09-20 13:27:47'),
 ('162','Black Bean Lettuce Roll-ups','Shake lemon juice, oil and a generous sprinkle of salt vigorously in a jar.\r\nPlace corn in very hot water for 1 minute: drain well: add lemon and oil.\r\nDrain beans well, dice tomatoes and scallions, and add these to corn.\r\nStir in parsley and cayenne and a little salt and pepper: stir occasionally while mixture sits at least 15 minutes (or more). \r\nSpoon onto lettuce leaves, roll-up, and ENJOY!\r\n\r\n','','6-8','2006-09-21 10:44:06'),
 ('163','Strawberry Treat','Place all ingredients in blender and blend until smoothe. \r\n\r\n','','6','2006-09-21 10:59:05'),
 ('164','Chicken and Wild Rice Soup','In saucepan combine all ingredients (other than those for thickening).\r\nBring to a boil, reduce heat, cover and simmer 50 minutes until rice is tender.\r\nMelt butter, whisk in flour and then half and half; cook and whisk until bubbly.\r\nSeason thickening with pepper and continue stirring and cooking one minute.\r\nRemove bay leaves and stir thickening into saucepan ingredients.\r\nAdd chicken and heat through.	\r\n','* Boil a lg chicken breast until cooked through or purchase packaged cooked chicken.','4-6','2006-09-21 11:03:48'),
 ('165','Red Dressing Salad','Mix all dressing ingredients well and salt and pepper to taste.\r\nPut greens in salad bowl and top with dressing.\r\n\r\n','','4','2006-09-21 11:21:09'),
 ('166','Apples and Kid Dip','Cut apples into thin slices just before serving.\r\nCombine dip ingredients and enjoy apples with dip.\r\n','','4','2006-09-21 11:39:36'),
 ('167','Chili Burgers','Brown hamburger, drain and add chili powder, beans, tomatoes, and corn.\r\nSimmer 10 minutes and then fill rolls with meat mixture, sprinkle with cheese.\r\n','','6','2006-09-21 13:12:17'),
 ('168','Cheesy Potato Bake','Stir all but topping ingredients together with salt and pepper to taste.\r\nPut in a greased 8-inch dish.\r\nSprinkle topping over and bake about 30 minutes.\r\n','','4','2006-09-21 13:24:25'),
 ('169','Just Fruit n’ Yogurt','Peel and cut banana in small pieces.\r\nStir banana with pear and yogurt and chill until ready to serve.\r\n\r\n\r\n','','4','2006-09-21 13:33:33'),
 ('170','Lemon Mayo Salmon','Prepare broiler.\r\nCombine all ingredients except salmon thoroughly and chill. \r\nSpray a broiler pan with nonstick spray and cook salmon on it 4-5 minutes per side until opaque.\r\nServe salmon with a spoon of chilled lemon mayonnaise.\r\n\r\n','','4','2006-09-21 17:02:03'),
 ('171','Cheesy Stuffing','Make stuffing according to directions on box (make sure stuffing is moist).\r\nMelt butter in skillet and sauté onion in it for 3-4 minutes.\r\nStir sautéed onion and cheese into prepared stuffing and microwave, covered, one minute, or until cheese is melted.\r\n','','4','2006-09-21 17:07:25'),
 ('172','Country Style Green Beans','Steam green beans: just rinse and microwave 4-8 minutes until just tender.\r\nHeat 1-2 tsp olive oil (pantry item) in a skillet over medium heat: add bacon and beans.\r\nSauté 4-5 minutes until lightly browned: put in a bowl and stir in almonds.\r\n','','4','2006-09-21 17:12:56'),
 ('173','Tomato Feta Chicken with Pasta','Cook chicken in lightly greased skillet 4 minutes, or until no longer pink. \r\nAdd one cup water, bring to a boil, add pasta, cover and simmer 5 minutes.\r\nCut ends off zucchini: slice and add to skillet along with tomatoes and olives.\r\nSimmer (uncovered) about 8 minutes more, until pasta is tender, making sure you add more water if it gets too dry.\r\nSalt and pepper to taste and sprinkle with cheese before serving.\r\n\r\n','','4','2006-09-22 09:15:20'),
 ('174','Tossed Salad Italiano','Put greens in a bowl and top with tomato.\r\nDrizzle dressing over salad (to taste) just before serving: top with croutons.\r\n\r\n	\r\n\r\n\r\n','','4','2006-09-22 09:22:12'),
 ('175','Sour Cream Grape Salad','Peel and chop kiwi and mix with grapes.\r\nStir dressing ingredients together and mix with fruit. \r\nChill until ready to serve.	\r\n\r\n','','6-8','2006-09-22 09:32:19'),
 ('176','Just Filet Mignon','Preheat broiler element and lightly spray a broiler pan.\r\nLay steak on pan and broil 3-6 minutes per side, until cooked through.\r\nSeason with salt and pepper to taste, after meat is cooked.\r\n','','4','2006-09-25 09:10:05'),
 ('177','Mashed Potatoes & Peas','Wash and cut potatoes into fourths (peeling is optional)\r\nMicrowave 3-5 minutes until potatoes are very soft.\r\nPut peas in very hot water for 3-4 minutes, until thawed and warm.\r\nMash (by hand or mixer) potatoes, butter, and milk.\r\nStir in drained, warm peas, and salt and pepper to taste. \r\n\r\n','','4','2006-09-25 09:12:03'),
 ('178','Hot Dressing Spinach Salad','Put spinach in a bowl and top with croutons.\r\nMix all dressing ingredients with a little salt, and microwave 30 seconds.\r\nStir dressing and toss desired amount with salad just before serving.\r\n','','4','2006-09-25 09:20:18'),
 ('179','Turkey & Swiss Calzone','Preheat oven to 350 degrees.	\r\nHeat a greased skillet and saute onion, peppers, and garlic 1-2 minutes.\r\nRoll dough out into a rectangle one-quarter to one-half inch thick. \r\nOn top of the dough layer turkey, cheese and sautéed veggies.\r\nRoll dough up and brush with melted butter: bake 20-30 minutes until golden.\r\n','','4-6','2006-09-25 09:27:10'),
 ('180','Tasty Cottage Cheese','Mix the two together and chill before serving.','','4','2006-09-25 09:35:33'),
 ('181','Simply Tossed Salad	','Top salad greens with crushed onions and serve with dressing.\r\n\r\n','','4','2006-09-25 09:38:56'),
 ('182','Green--Eggs and Ham Soup','Put 7 cups water, peas and onion in a saucepan: boil with lid tilted one hour.\r\nAdd butter, ham and eggs to peas and simmer 10 minutes.\r\nSalt and pepper to taste.\r\n','','4','2006-09-25 09:42:08'),
 ('183','Zippy Cheese‘n Crackers','Spread cream cheese--thin layer--in the bottom of a small dish (about 6x6).\r\nSprinkle cheddar on top and pour marinade over the cheeses.\r\nLet sit 30 or more minutes and then serve with crackers.\r\n','','4','2006-09-25 09:48:58'),
 ('184','Honey Fruit Salad','Mix fruit with dressing and chill until ready to serve.','','4-6','2006-09-25 09:59:59'),
 ('185','Easy Beef Lasagna','Preheat oven to 400°F. Brown beef and onion in skillet.\r\nStir in tomato soup and water and heat through.\r\nCombine mushroom soup, milk and ½ cup cheese in a bowl.\r\nSpoon half the meat from skillet into a 2-quart baking dish.\r\nTop meat with 3-4 lasagna noodles and then mushroom soup mixture. \r\nTop with remaining lasagna noodles and remaining meat mixture.\r\nBake, covered, 40 minutes: uncover, top with remaining cheese. \r\nBake 10 minutes more. Let stand 10 minutes. \r\n\r\n','','8','2006-09-25 10:12:28'),
 ('186','Green Beans and Tomatoes','Put beans and tomato in casserole dish. \r\nStir in ranch dressing and cheese.\r\nMicrowave 3 minutes or until beans are hot.\r\n','','4','2006-09-25 10:32:31'),
 ('187','Hot Parsley Bread','Preheat oven to broil and lay bread out flat on baking sheet.\r\nBlend all other ingredients and spread on bread halves.\r\nPlace bread under broiler and cook until bubbly.\r\n','','6','2006-09-25 10:36:20'),
 ('188','Apricot Chicken Thai Salad','Put salad greens in serving bowl and layer apricots, chicken and sprouts.\r\nCombine vinegar, cilantro, and sugar; whisk in oil and cayenne.\r\nDrizzle over salad and top with peanuts just before serving.\r\n','Tip: Salad is best if left to marinate several hours before serving.\r\n\r\n','4','2006-09-25 10:42:22'),
 ('189','French Onion Soup','Saute onion in butter for 10 minutes.\r\nPut consommé, onion, and worcestershire in a saucepan.\r\nBring to a boil, reduce heat and simmer 15 minutes.\r\nDivide soup between soup bowls and top with bread and cheese.\r\n\r\n','','4','2006-09-25 10:57:57'),
 ('190','Spiced Ham','Preheat oven to 350 degrees.\r\nSpread layer of mustard on ham slices: lay them in a pan, overlapping okay.\r\nPour sauce ingredients over ham slices and bake 15 minutes.\r\nPour cream over the ham and bake another 25-30 minutes.\r\n','','6','2006-09-26 07:32:16'),
 ('191','Scalloped Potatoes','Preheat oven to 350 degrees	\r\nPierce scrubbed potatoes and microwave 5 minutes until barely soft.\r\nCool and slice thin (peeling optional) and lay in a small casserole dish.\r\nMix all other ingredients, except cornflake crumbs, until smooth.\r\nPour over potatoes, top with crumbs and bake 40-50 minutes (until bubbly).\r\n','','4-6','2006-09-26 12:15:16'),
 ('192','Honey Mustard Salad','Put salad greens and scallions in a bowl.\r\nWhisk dressing ingredients vigorously: pour over salad just before serving.\r\n\r\n','','4','2006-09-26 12:23:34'),
 ('193','Chicken Tortilla Pie','Preheat oven to 350 degrees.\r\nFry chicken in the oil until no longer pink.\r\nAdd chili powder and onion, and then sour cream and bouillon: heat through.\r\nIn a baking dish layer broken chips, skillet mixture, and cheese.\r\nBake about 20 minutes or until bubbly. \r\n\r\n','','4','2006-09-26 12:30:49'),
 ('194',' Cauliflower Casserole','Preheat oven to 350 degrees. \r\nRinse cauliflower and microwave it with the onion 2 minutes. \r\nWhisk sour cream, bouillon, milk and flour together: add to cauliflower. \r\nTop with cheese, and bake covered for 20 minutes.\r\nUncover, sprinkle with croutons and bake 10 minutes or until bubbly. \r\n\r\n','','4','2006-09-26 12:36:08'),
 ('195','Lemonade Salad','Cut oranges and bananas into small pieces and put in salad bowl.\r\nMix all dressing ingredients in a blender.\r\nPour dressing over fruit (to taste) and stir.\r\n\r\n','','4','2006-09-26 12:41:21'),
 ('196','Meatball Stroganoff','Cook meatballs according to package directions.\r\nSauté onion in 1 Tbsp cooking oil 2-3 minutes.  \r\nStir in flour, garlic salt, and a little pepper; cook and stir 1 minute. \r\nStir in soup and simmer 10 minutes, stirring occasionally.\r\nAdd sour cream, and heat thoroughly.   Serve over noodles.\r\n \r\n','','8','2006-09-26 15:18:29'),
 ('197','Swiss Carrots','Preheat oven to 375°F.\r\nPut carrots in an 8x8 dish, and sprinkle with salt and pepper, and cheese. \r\nMelt butter with the onion, 30-45 seconds in microwave.\r\nWhisk in flour and salt to taste and then the milk.\r\nPour sauce over carrots and cheese.\r\nBake 10 minutes covered: uncover and cook 12 minutes until top is golden.\r\n\r\n','','4','2006-09-26 15:22:42'),
 ('198','Spinach Orange Salad','Put spinach in salad bowl: peel and chop orange small and add to bowl.\r\nTop with red onion rings.\r\nMix all dressing ingredients well with a little salt (warm honey if necessary).\r\nPour dressing over salad just before serving, toss and Enjoy!\r\n\r\n','','4','2006-09-26 15:29:10'),
 ('199','Swiss Cheese Pie','Preheat oven to 350°F.	\r\nStir sliced vegetables with melted butter. \r\nSprinkle with salt and pepper and flour: stir.\r\nStir in cheese and put all into pastry shell. \r\nMix eggs and milk and pour over the pie. \r\nBake 40 minutes, or until pie is browned. \r\n','','4','2006-09-26 15:37:34'),
 ('200','Broccoli and Lemon','Lay broccoli in an 8x8 dish and stir in lemon juice.\r\nMelt butter and bouillon together: whisk in flour and cream and parmesan.\r\nPour butter mixture over broccoli, cover and microwave 2-4 minutes, or until broccoli is as tender as you like.\r\n\r\n\r\n','','4','2006-09-26 15:51:34'),
 ('201','Fruit Fizz','Combine all ingredients and let sit until berries are thawed, then keep chilled.','Tip: Good to make ahead, but not a must.\r\n\r\n','6-8','2006-09-26 15:56:40'),
 ('202','Chicken with Bow Tie','While pasta boils, cook chicken in a tsp of olive oil until no longer pink.\r\nAdd mushrooms and sauté 1 minute; add artichoke hearts; turn off heat.\r\nWhisk sauce ingredients together.\r\nDrain pasta and stir it with the sauce.\r\nCombine chicken mixture with pasta: serve with additional parmesan.\r\n','','4','2006-09-26 16:01:46'),
 ('203','Sicilian Bruschetta','Blend all ingredients, except bread, in blender; salt to taste.\r\nSlice baguette at an angle, brush with olive oil: broil both sides until golden.\r\nDip bread in tomato mixture (warm or cold) and enjoy!\r\n\r\n','','4-6','2006-09-26 16:09:16'),
 ('204','Banana Lime Salad','Put fruit in salad bowl.\r\nCombine all dressing ingredients well, until sugar dissolves.\r\nStir dressing with fruit and refrigerate until ready to serve.\r\n','','4-6','2006-09-26 16:14:02'),
 ('205','',null,null,null,'2006-09-26 20:42:08'),
 ('206','Baked Salmon Rosemary','Preheat* oven to 425°. \r\nUsing a fork mix all ingredients but salmon and olive oil.\r\nArrange salmon steaks in a lightly oiled baking dish.\r\nPress breadcrumb mix onto the top of each salmon steak and drizzle with oil. \r\nPlace in oven and roast 10-12 minutes or until fish is cooked through.\r\n\r\n','* If cooking in same oven as potatoes, allow about 18 minutes of cooking time at 375 degrees','4','2006-09-27 08:42:55'),
 ('207','Potato Gratin','Preheat oven to 375°F. \r\nSaute onion in butter about 5 minutes, until soft: cool and add romano.\r\nCut potatoes in 1/8-inch thick pieces: layer half in a greased 8x8 dish.\r\nSpread with onion mixture: add remaining potatoes, and then swiss cheese.\r\nMix the bouillon thoroughly with 2/3 cup hot water and pour over potatoes.\r\nBake uncovered about 1 hour, or until potatoes are tender and most of the liquid is evaporated.\r\n','','','2006-09-27 08:52:33'),
 ('208','Sesame Seed Beans','Wash beans and cut ends off. Place in microwave safe dish.\r\nMix sauce ingredients and stir into beans.\r\nCover beans with plastic wrap and poke a few holes to let steam escape.\r\nMicrowave 10 minutes, or until beans are tender.\r\n','','','2006-09-27 08:56:42'),
 ('209','Orange Slices','Cut the ends off oranges and then cut the orange into thick rings and divide between dinner plates.\r\n\r\n','','','2006-09-27 09:00:32'),
 ('210','Chinese Pot Roast','Preheat oven to 300 degrees.\r\nSeason meat with salt and pepper: sear in hot roasting pan until browned.\r\nMix sauce and juice and pour over meat. \r\nCover meat and bake about 2 hours, or until done to your liking.\r\nLet meat sit 10 minutes before carving.\r\n\r\n','','6-8','2006-09-27 09:42:02'),
 ('211','Stuffed Mushroom Side','Preheat oven to 425 degrees.\r\nTake stems out of mushrooms and chop to make half a cup.\r\nSaute stems and onion in butter: combine with garlic, crumbs and cheese.\r\nStuff mushrooms and bake 8-12 minutes. (While meat “sits” after cooking)\r\n\r\n','','6','2006-09-27 09:44:52'),
 ('212','Blushed Leaf Tossed Salad','Add first 4 ingredients to salad bowl.\r\nStir sugar and nuts in warm saucepan until sugar melts and nuts coated.\r\nPour nuts, to cool, onto sprayed surface (plate, cutting board, etc.).\r\nCrumble nuts over salad and add dressing just before you serve. \r\n','','','2006-09-27 09:51:54'),
 ('213','Alfredo Chicken Soup','Dice potato and microwave 2-3 minutes until barely soft. (Peeling optional)\r\nAdd chicken, broth, broccoli, celery and potato to saucepan. \r\nSimmer uncovered 5 minutes: add alfredo and bring to a simmer.\r\nServe with a sprinkle of basil on top.\r\n','','4-6','2006-09-27 10:29:41'),
 ('214','Katie\'s Apple Salad','Put apples and grapes in salad bowl.\r\nStir all dressing ingredients together and mix with fruit.\r\nChill until ready to serve.\r\n','','','2006-09-27 15:16:26'),
 ('215','Toasted Bagels','Toast bagels and spread with your favorite spread.','','','2006-09-27 15:45:04'),
 ('216','Sausage Rolls','Preheat oven to 350 degrees.\r\nBrown sausage in skillet.	\r\nWarm cream cheese until very soft.\r\nUnroll crescent rolls and spread each one with cream cheese.\r\nPlace a sausage on each roll and starting at the wide end roll up.\r\nPut rolls in a shallow pan and bake 12-15 minutes.\r\n\r\n','','4','2006-09-27 15:50:02'),
 ('217','Gazpacho','Combine all ingredients thoroughly.\r\nCover and refrigerate for 3 to 5 hours. Enjoy!\r\n','Make Ahead','','2006-09-27 15:53:27'),
 ('218','Pear Halves',null,null,null,'2006-09-27 16:04:10'),
 ('219','Pears n’ Cheese','Divide cottage cheese amongst pear halves.\r\nSprinkle cheddar over.	\r\n','','','2006-09-27 16:05:07'),
 ('220','Tortellini with Fresh Vegetables','Cook and drain tortellini as directed on package. \r\nIn 3 quart saucepan heat oil over medium-high. \r\nCook bell pepper in oil 2 minutes, stirring occasionally. 	\r\nStir in tomatoes, squash, Italian seasoning and garlic salt. \r\nCover and cook 3 minutes, stirring occasionally, until squash is tender. \r\nStir in tortellini and cook 2 minutes, stirring occasionally, until hot. \r\nSprinkle each serving with parmesan. \r\n\r\n','','6','2006-09-27 16:08:06'),
 ('221','Red Ants on a Log','Trim each stalk of celery: wash and dry.\r\nSpread stalks with peanut butter and sprinkle with craisins.\r\n','','4','2006-09-27 19:40:03'),
 ('222','Orange Muffin','Preheat oven to 375 degrees.\r\nPeel and chop orange into bite sized pieces (no more than 3/4 cup).\r\nMix all ingredients in the order given with enough orange juice to make dough moist (“about” 1/2 cup).\r\nDrop dough into lightly greased muffin pan (fill 6-8 holes two-thirds full)\r\nBake 12-15 minutes and enjoy warm with butter.\r\n\r\n','','','2006-09-27 19:43:09'),
 ('223','Sweet Lemon Chicken','Preheat oven to 350°F. \r\nCombine all ingredients with a little salt, except chicken. \r\nDip chicken in honey mixture (use it all) and arrange in an 8-inch dish. \r\nBake 40-50 minutes, or until chicken is cooked through.\r\n','','','2006-09-28 11:56:02'),
 ('224','Nut n\' Creamy Rice','Bring 2 cups salted water to a boil in a saucepan. \r\nStir in rice, butter and sugar and return to a boil.\r\nReduce heat, cover and simmer 15-20 minutes, until water is absorbed.\r\nStir in cream: simmer 2 minutes.\r\nAdd almonds and cheese, stir and serve.\r\n\r\n','','4','2006-09-28 12:04:00'),
 ('225','Bacon French-Cut Beans','Cook bacon until crisp: crumble it in the skillet and add onion and garlic.\r\nSauté onion, garlic, and bacon for 3 minutes. \r\nAdd tomato and beans to skillet and continue cooking 4-5 minutes. Enjoy!\r\n\r\n','','4','2006-09-28 12:08:12'),
 ('226','Toasty Sirloin Sandwich','Spread cut sides of rolls with dressing and broil tops until lightly browned.\r\nCut cheese slices in half and lay on top of 4 of the roll halves (3 slices each).\r\nBroil 1 minute or until cheese just begins to melt. \r\nStir dressing mix with beef strips, pressing mix into meat as you stir. \r\nCook meat in skillet until almost cooked through (do not overcook)\r\nCombine spinach, tomato, and basil and divide between each roll half.\r\nArrange sirloin strips over spinach mixture and enjoy.\r\n','','','2006-09-28 12:20:11'),
 ('227','Cole Slaw','Put coleslaw into a bowl.\r\nPut all dressing ingredients, except vinegar, into a saucepan and cook while stirring with a wire whisk, over low heat, until it thickens.\r\nPour hot dressing over coleslaw mix and stir in vinegar. \r\nLet cool and then chill before serving.\r\n\r\n','*Make Ahead    ','4-6','2006-09-28 12:29:18'),
 ('228','Hash Browns','Cook according to package directions: season with garlic salt.','','4','2006-09-28 12:35:36'),
 ('229','Creamy Broccoli Soup','Mix 2 cups water with first 4 ingredients in saucepan: bring to a boil.\r\nCover pan and simmer 6 minutes, or until vegetables are tender. \r\nWhisk milk, half and half, cornstarch, thyme and pour into saucepan.\r\nCook (medium heat) stirring constantly until soup thickens and barely boils.\r\nRemove from heat: stir in salt and pepper to taste.\r\nServe sprinkled with cheese.\r\n','','','2006-09-28 12:38:36'),
 ('230','Easy Pita with Sprouts','Spread mayonnaise in pitas.\r\nStuff with next 3 ingredients and season with salt and pepper to taste.\r\n\r\n','','4','2006-09-28 12:46:24'),
 ('231','High in C Salad','Peel and chop grapefruit and stir with sugar for 1 minute.\r\nPeel and chop oranges into bowl with grapefruit.\r\nPeel, pit and chop avocado: stir with fruit and chill until ready to serve.\r\n\r\n\r\n','','4','2006-09-28 12:49:36'),
 ('232','Nippy Pork Chops','Preheat oven to 350 degrees and heat oil in large skillet.\r\nSpread chops with a thin layer of mustard; sprinkle with salt and pepper.\r\nRoll chops in flour and brown both sides in hot oil.\r\nPlace chops in baking dish; cover with soup and bake 1 hour.\r\n\r\n','','','2006-09-28 13:30:28'),
 ('233','Zucchini Jack','Melt butter in skillet: add zucchini, parsley, and onion. \r\nAdd salt and pepper to taste, 1 Tbsp water, and cheese. \r\nCover skillet and simmer 10 minutes or until zucchini is tender.\r\n\r\n','','4','2006-09-28 13:34:27'),
 ('234','Raspberry Romaine','Microwave fully cooked bacon 30 seconds: cool and crumble over romaine.\r\nAdd crumbled feta and cashews to salad.\r\nMix raspberries and dressing, giving berries a few minutes to thaw.\r\nDrizzle dressing (amount to taste) over salad just before serving.\r\n	\r\n','','4','2006-09-28 13:42:38'),
 ('235','Rich Primavera','Cook fettuccine according to package: while it cooks-- \r\nRinse carrots and microwave 1 minute: add zucchini and microwave 30 seconds more.\r\nCombine ricotta and heavy cream in a blender or bowl and mix until smooth. \r\nMelt butter and sauté garlic and bell pepper 1 minute. \r\nStir in ricotta mixture and bring to a boil, stirring occasionally. \r\nStir everything with ricotta mixture and salt and pepper to taste. \r\nToss until heated through before serving.\r\n\r\n','','4-6','2006-09-28 13:48:33'),
 ('236','Apple Grape Salad','Combine all ingredients in a bowl. \r\nChill before serving\r\n','','','2006-09-28 14:00:37'),
 ('237','Italian Toss','Put dressing in bottom of salad bowl.\r\nAdd mushroom, pepper, tomato and stir.\r\nTop with greens, but don’t stir.\r\nCover and refrigerate until meal is ready; then toss and serve.\r\n','*Optional: top with grated parmesan\r\n','4','2006-09-28 14:03:52'),
 ('238','Nut n\' Honey Pork Stir-Fry','Stir cornstarch into juice and soy sauce until it dissolves: add honey.\r\nHeat oil in a skillet over medium high: add pork and stir-fry 3 minutes.\r\nAdd carrots and celery and stir-fry 2-3 more minutes.\r\nStir in sauce mixture and cook until sauce thickens.\r\nAdd nuts and heat through (about 1 minute). \r\nEnjoy over rice.\r\n','','','2006-09-29 12:22:14');
insert into `recipes` values('239','Strawberry Spinach Delight','Mix salad ingredients in order given.\r\nShake or blend dressing ingredients and toss with salad just before serving.\r\n\r\n','','','2006-09-29 12:33:45'),
 ('240','Tasty Turkey','Preheat oven to 325°F: sprinkle salt and pepper liberally in turkey cavity.\r\nPat skin dry with paper towel and brush turkey with part of the melted butter. \r\nPlace turkey on a roasting rack inside a roasting pan. \r\nMix bouillon with 1 1/3 cups water until dissolved (heat if necessary)\r\nStir in remaining butter.\r\nRoast turkey 20 minutes per pound, basting with bouillon every 25 minutes.\r\nTurkey is done when meat thermometer registers 175°F when inserted into thickest part of the thigh (or when thigh and leg fall easily away when pulled).\r\nLet turkey stand 20 minutes before carving. \r\n\r\n\r\n','','12','2006-09-29 14:08:35'),
 ('241','Baked Yam and Pineapple','Preheat oven to 350°F.\r\nPlace pineapple slices in an 8x8 dish: sit juice aside.\r\nSpread yams on top of the pineapple.\r\nCream butter, sugar, and ground cinnamon and crumble over the yams.\r\nPour reserved pineapple juice over all and bake 40 minutes.\r\nRemove from oven, add marshmallows, return to oven and bake 5-10 minutes until marshmallows turn brown.	\r\n','','6-8','2006-09-29 14:42:57'),
 ('242','Onion Crunch Peas','Put peas in a bowl and microwave 3 minutes.\r\nStir in butter, and salt and pepper to taste: continue to microwave 2-3 minutes until hot.\r\nStir in crispy onions and serve.\r\n	\r\n','','','2006-09-29 14:48:39'),
 ('243','Butterscotch Bundt Rolls','Coat a bundt pan with nonstick cooking spray.\r\nLayer nuts and rolls in the pan.\r\nMix sugar and pudding together and sprinkle on top.\r\nDrizzle butter over the top of that. \r\nCover with plastic wrap (or waxed paper). \r\nLet rise 4-5 hours at room temperature, or about 2 hours in a warm place.\r\nPreheat oven to 350° degrees.\r\nBake 20 minutes covered and then 10-15 minutes more uncovered.\r\nRemove from oven and immediately loosen rolls from sides of pan with a knife and invert onto a platter. \r\n','Make Ahead','12','2006-09-29 14:53:03'),
 ('244','Yummy Stuffing Balls','Preheat oven to 325 degrees.\r\nBrown meat; drain and combine with dry stuffing mix.\r\nStir in cranberry sauce, egg and 1 cup water.\r\nShape into 16 balls and place on foil covered baking sheet.\r\nBrush with melted butter and bake 20 minutes.\r\n','','4','2006-09-29 17:40:19'),
 ('245','Green Beans and Almonds','Put beans in microwave safe dish: warm for 1minute.\r\nStir in butter: salt and pepper to taste.\r\nStir in almonds.\r\n','','','2006-09-29 17:45:33'),
 ('246','Vanilla Pudding Salad','Whisk pudding 2 minutes with one and three-fourths cups milk or water.\r\nStir in pear and berries; chill until ready to serve.\r\n\r\n','','6','2006-09-29 17:49:30'),
 ('247','Mexi-Pasta','Cook pasta according to package directions. \r\nHeat skillet while you combine beef and next 5 ingredients; toss to coat. \r\nAdd beef mixture to skillet and stir-fry 1 minute, until outside is browned.\r\nRemove meat from skillet and add 1/2 cup water, pasta, salsa, and beans.\r\nCook 4-5 minutes or until heated through, stirring occasionally.\r\nReturn beef to skillet; stir to combine and enjoy!\r\n\r\n','','6','2006-09-29 17:59:29'),
 ('248','Avocado Nut Salad','Combine avocado and lemon juice in salad bowl.\r\nAdd bag of greens and nuts and toss.\r\nMix dressing with sugar and pour over salad: Enjoy!\r\n\r\n','','','2006-09-29 18:07:37'),
 ('249','Leftover Turkey Sandwich','Spread cranberry sauce on half the bread slices.\r\nAdd turkey—salt and pepper to taste, and top with cheese.\r\nCover each sandwich with the remaining bread slices.\r\nMelt butter on hot griddle (or skillet) and cook sandwiches over medium-low until brown; flip and cook other side until brown and cheese is melted.\r\n\r\n','','4','2006-09-29 18:33:38'),
 ('250','Sausage Chili Potatoes','Microwave potatoes about 3-5 minutes, until tender.\r\nBrown sausage: drain, and add all other ingredients.\r\nSauté 5 minutes, stirring occasionally.\r\n','','4','2006-09-29 18:39:03'),
 ('251','Simple Toss','Top greens with croutons and cheese and serve with dressing on the side.\r\n\r\n','','4','2006-09-29 18:43:34'),
 ('252','Mac & Cheese Pizza','Preheat oven to 375°F.\r\nPrepare macaroni as directed on package. \r\nStir eggs into macaroni; spread into a well-greased 13x9 pan. \r\nBake 10 minutes.	\r\nCombine tomato sauce, onion, and oregano and spread over macaroni.\r\nTop with bell pepper, pepperoni and cheese. \r\nBake another 10 minutes: Enjoy!\r\n\r\n','','4','2006-10-03 12:56:02'),
 ('253','Chili Chips','Combine all but chips and heat in saucepan or microwave, covered for 30 second intervals (stir each time) until well blended and hot.\r\nDip chips in chili mixture and enjoy!\r\n','','6-8','2006-10-03 13:07:52'),
 ('254','Coconut n\' Fruit','Combine all ingredients in a mixing bowl and toss.\r\nChill until ready to serve.\r\n','','4-6','2006-10-03 13:15:49'),
 ('255','Hot Dogs with Barbecue Sauce','Heat oil in skillet over medium high heat and sauté onion 2-3 minutes.\r\nStir in next 4 ingredients and one-third cup water.\r\nSimmer 15 minutes, stirring frequently. \r\nSplit hot dogs and spread lightly with mustard.\r\nBroil 2-3 minutes, or until edges are crisped.\r\nTop hot dogs with sauce to taste.\r\n\r\n','','4','2006-10-03 13:19:58'),
 ('256','Pineapple Baked Beans','Put all into crockpot: stir, cover and cook on low for 8 hours.\r\nOr cook covered in 200 degree oven for 8 hours (more or little less okay). \r\n\r\n','*Delicious! Share the extra or freeze for use with a meal later.\r\n\r\n\r\n','16*','2006-10-03 13:26:33'),
 ('257','Mom\'s Potato Salad','Wash potatoes (do not dry) and put in shallow dish: microwave 3-5 minutes, or until potatoes are tender (but not mushy soft).\r\nCool under cold water and chop into bite-sized pieces (no peeling necessary).\r\nAdd remaining salad ingredients to bowl and salt and pepper to taste.\r\nStir all dressing ingredients together and stir dressing into salad.\r\nChill until ready to serve. (All day makes it taste even better) \r\n\r\n','','4-6','2006-10-03 13:34:47'),
 ('258','Tortilla Casserole','Heat oven to 350 degrees. \r\nBrown beef and onion in skillet, stirring occasionally: drain. \r\nSpread one-half cup salsa in bottom of an 8x8 dish. \r\nMix remaining salsa, the sour cream and soup.\r\nOn top of salsa layer half the tortilla strips, beef, soup and cheese; repeat. \r\nBake uncovered about 30 minutes or until hot and bubbly.  \r\n','','4-6','2006-10-03 13:47:04'),
 ('259','Broccoli and Zucchini Salad','Rinse broccoli (do not dry) and microwave 2 minutes: cool.\r\nStir zucchini* and bell pepper with cooled broccoli.\r\nPour dressing over vegetables and toss.\r\n','*If you prefer to slightly cook zucchini also, add it to microwave dish with the broccoli the last minute of cooking time.','4','2006-10-03 13:54:10'),
 ('260','Orange Crescents','Mix butter, sugar and orange peel.\r\nLay rolls flat and spread with orange mixture.\r\nNow follow package directions for rolling, baking, etc.\r\n','','4','2006-10-03 13:58:12'),
 ('261','Chicken White Beans and Rice','Heat oil in skillet over medium-high heat and add chicken, onion, and garlic; cook 7 minutes or until chicken is slightly browned and onion is tender.\r\nAdd broccoli and tomatoes and simmer 3-4 minutes.\r\nAdd rice, navy beans, Italian seasoning, and vinegar. \r\nStir and simmer covered 4 minutes.\r\nSprinkle with Parmesan cheese and enjoy. \r\n','','','2006-10-03 14:07:28'),
 ('262','Spinach Papaya Salad','Place salad ingredients in a bowl. 	\r\nShake dressing ingredients in a jar with a tight-fitting lid and toss with salad.\r\n\r\n','','4','2006-10-03 16:25:50'),
 ('263','Magnifico Bread Salad','Put garlic in large salad bowl and rub it around sides and bottom.\r\nCut bread into bite-sized pieces, and put in salad bowl with veggies.	\r\nMix dressing ingredients well: just before serving toss enough dressing with salad to lightly coat the veggies.\r\n\r\n','','4','2006-10-03 16:34:39'),
 ('264','Canadian Cheese Soup','Saute onion in butter 2 minutes.\r\nAdd flour, cornstarch, paprika, salt and pepper to taste: simmer 5 minutes.\r\nAdd milk, bouillon, and 2 cups water.\r\nCook, stirring constantly, until thickened.\r\nMicrowave carrot and celery 3-4 minutes or until soft: mash slightly and add to soup.\r\nStir in cheese until melted: taste and add more salt and pepper if desired.\r\nStir in parsley and enjoy!\r\n','','4','2006-10-03 16:42:26'),
 ('265','Avocado n\' Cheese Quesadilla','Preheat BBQ grill, or broiler.\r\nMash avocado with sour cream and salsa: spread on half of the tortillas. \r\nCover the tortillas spread with avocado mix with another tortilla.\r\nPlace tortilla sandwiches on grill or broiler pan and cook for two minutes.\r\nCarefully turn, sprinkle with parmesan, and cook for two more minutes.\r\nCut each quesadilla into wedges.\r\n','','4-6','2006-10-03 19:10:51'),
 ('266','Quick Pumpkin Muffins','Preheat oven to 350 degrees.\r\nMix ingredients well and divide into cupcake pan (lightly greased).\r\nBake 10-15 minutes, or until no longer gooey in centers. \r\nEnjoy with your favorite spread!\r\n','*These muffins freeze well\r\n	\r\n','12*','2006-10-03 19:13:57'),
 ('267','Chicken Pineapple Burgers','Preheat broiler (or barbecue).\r\nMix all recipe ingredients but pineapple and buns with an electric mixer.\r\nShape into 6 patties: broil or barbecue, turning once, until cooked through.\r\nWhen almost done place a pineapple slice on each patty and cook 1 minute.\r\n\r\n','','6','2006-10-04 09:17:06'),
 ('268','Melted Cheese Fries','Season fries with garlic salt and cook according to package directions.\r\nThen, place under broiler for 3-5 minutes to \"crisp\": stir occasionally.\r\nPut cheese, milk and mustard in dish and microwave until cheese is melted.\r\nStir well and pour across fries.\r\nServe immediately.\r\n','','4','2006-10-04 09:27:42'),
 ('269','Sunflower Broc Bacon Salad','Rinse broccoli and microwave 1 minute: cool completely.\r\nAdd salad ingredients to bowl.\r\nCombine dressing ingredients and stir into salad.\r\n\r\n','','6','2006-10-04 09:30:15'),
 ('270','Garlic Shrimp','Heat oil on medium and sauté onions, bell pepper, and garlic 2 minutes. \r\nAdd butter, shrimp, red pepper, and salt and pepper to taste.\r\nCook until shrimp is pink, about 10 minutes.\r\n','','4-6','2006-10-04 10:11:36'),
 ('271','Sweet Onion Curry','Heat oil in skillet: add curry powder, salt and onions and sauté 5 minutes. \r\nStir in brown sugar for half a minute. \r\nEnjoy hot.\r\n','','4-6','2006-10-04 11:33:16'),
 ('272','Creamy Sausage Stroganoff','While noodles boil--\r\nBrown sausage, crumbling into small pieces: drain partly.\r\nSaute butter and onion in microwave 1 minute.\r\nStir onion/butter into sausage along with the soup, milk and sour cream.\r\nSalt and pepper to taste.\r\nDrain noodles and serve sauce over them.\r\n	\r\n','','6','2006-10-04 12:12:14'),
 ('273','Bean and Olive Italiano','Mix all together and chill until ready to serve.\r\n\r\n','','4','2006-10-04 12:18:04'),
 ('274','Toasted Parmesan Muffins','Toast muffins and spread with butter while hot.\r\nSprinkle with garlic and cheese.\r\n\r\n','','4','2006-10-04 12:22:07'),
 ('275','Tex Mex Tortilla Soup','Boil chicken or sauté in skillet until cooked through: chop small.\r\nStir 2 cups water with broths, onion, tomato, pepper and corn: bring to a boil.\r\nAdd chicken pieces and spices: simmer 10-20 minutes.\r\nPut tortilla chips in soup bowls and top with soup and then cheese.\r\n\r\n','*Use canned or make your own with bouillon.\r\n\r\n','8','2006-10-04 14:52:21'),
 ('276','It\'s A Wrap','Mix softened cream cheese and ranch dressing together.\r\nDivide and spread amongst the tortillas (about 2 Tbsp each).\r\nSpread diced veggies over tortillas: roll, cut in half and enjoy!\r\n\r\n\r\n','','4','2006-10-04 15:08:19'),
 ('277','Apple Salad','Mix apple, raisins, and pecans.\r\nMix dressing ingredients well and stir into salad.\r\n\r\n','','4','2006-10-04 15:16:13'),
 ('278','Quiche Lorraine','Bake pie crust in preheated 425 degree oven 5 minutes (do not prick)\r\nRemove crust and turn heat to 325 degrees.\r\nArrange cheese, bacon, ham and mushrooms in bottom of shell.\r\nCombine eggs, cream, salt and dry mustard: add to pie shell.\r\nBake (at 325) for 45 minutes or until “set.”\r\nRemove from oven and let stand 5-10 minutes before serving.\r\n','','4-6','2006-10-04 20:19:21'),
 ('279','Sweetened Carrots','Rinse carrots and microwave 2-3 minutes until barely tender.\r\nMelt butter in skillet over low heat, add sugar and stir until sugar turns golden.\r\nStir in carrots and cook until glazed: season with salt.\r\n','','4','2006-10-04 20:27:51'),
 ('280','Spinach Avocado Salad','Toss salad greens, spinach, onion and avocado.\r\nSprinkle nuts on top and drizzle with dressing.\r\n','','6','2006-10-04 20:30:06'),
 ('281','Beef with Horsey Sauce','Preheat oven to 425 degrees. Place meat on rack in open, roasting pan.\r\nBrush meat with melted butter and cook 45 minutes (to your liking)\r\nFor sauce: melt butter and whisk in flour: season with salt and pepper.\r\nCook until bubbly, then add milk and stir constantly until boiling and thick.\r\nRemove from heat and stir in horseradish and mustard. \r\nServe warm sauce with sliced meat.\r\n','','6','2006-10-06 06:56:40'),
 ('282','Cheesy Potatoes','Preheat oven to 350°F. \r\nLay potato and onion in an 8x8 dish: sprinkle with salt and pepper.\r\nSprinkle 1 cup cheddar over potatoes/onions.\r\nCombine cream, milk and mustard and pour over potatoes/onion.\r\nSprinkle top with remaining cheese. \r\nBake 40 minutes, or until potatoes are tender.(If you need to cook potatoes in same oven as the beef (at 425 degrees), cover potatoes and cook 20 minutes, uncover and cook for another 5-10 minutes)','','4','2006-10-06 07:11:13'),
 ('283','Carrot Celery Salad','Rinse carrots and celery and microwave 1-2 minutes until barely tender.\r\nRun veggies under cold water to cool thoroughly.\r\nMix dressing ingredients and stir into carrots and celery.\r\n\r\n','','4','2006-10-06 07:14:09'),
 ('284','Apply Chicken Strips','Preheat oven to 350 degrees.\r\nLay chicken in 8-inch pan and season well with salt, and pepper.\r\nMelt butter in skillet and stir in onion, apple and curry: stir-fry 1-2 minutes.\r\nCombine soup and sour cream with skillet mixture and pour over chicken.\r\nBake, uncovered 45 minutes (or until chicken is cooked through).\r\nServe over the zucchini rice.\r\n','','4-6','2006-10-06 07:40:41'),
 ('285','Zucchini Rice Pilaf','Heat oil in skillet: saute rice and garlic stirring constantly until rice is golden.\r\nAdd 2 cups water and bouillon and bring to a boil.\r\nReduce heat, cover saucepan and simmer 15 minutes.\r\nAdd zucchini without stirring: cover and simmer 5 minutes.\r\nSalt and pepper to taste.\r\n','','4','2006-10-06 07:47:20'),
 ('286','Cheese Bacon Crescents','Preheat oven to 375 degrees.\r\nPut bacon in microwave for 30 seconds: crumble and mix with cheese.\r\nSeparate dough into 8 triangles, and cut each one in half lengthwise.\r\nSpread each dough triangle with 1 generous tsp cream cheese mixture.\r\nRoll up starting at smallest end of triangle: place on baking sheet.\r\nBake about 12 minutes, or until golden brown. (If you need to use 350 degree oven--with chicken-- add 5 minutes or so)','*Good appetizer too','8','2006-10-06 07:55:13'),
 ('287','Berries','Stir berries with sugar and let sit until berries are completely thawed.','','4','2006-10-06 08:06:22'),
 ('288','Ham and Linguine','Cook pastas together according to package: drain and return to pan.\r\nCombine cream and egg yolks and beat well. \r\nAdd butter, ham, and green onion to egg and cream.\r\nSlowly stir egg mixture into linguine, mixing well over medium heat.\r\nAdd half the Parmesan cheese until thickened.\r\nRemove from heat, put linguine in serving dish: top with remaining Parmesan.\r\n','*½ cup sliced mushrooms is a good addition to this dish','4','2006-10-06 08:20:24'),
 ('289','Sweet Orange Salad','Combine all dressing ingredients but cream in a saucepan and cook, stirring until it thickens: cool completely.\r\nWhip cream and fold into cooled mixture.\r\nStir dressing with fruit.\r\n\r\n','','8','2006-10-06 08:26:40'),
 ('290','Two-Cheese Bread','Preheat oven to 400°F and place bread on baking sheet.\r\nHeat oil in a skillet over medium high heat. \r\nSauté garlic 2 minutes and brush garlic oil over bread.\r\nAdd a layer of tomatoes.\r\nTop with cheese and sprinkle with basil.\r\nArrange bread on a baking sheet and bake 10 minutes.\r\n\r\n','','4-6','2006-10-06 08:33:45'),
 ('291','Beefy Mashed Potatoes','Prick potatoes and microwave 4-7 minutes, until soft (peeling is optional).\r\nMash with milk (more if necessary), butter, and salt and pepper.\r\nSpread potatoes in the bottom of a lightly sprayed 8-inch baking dish.\r\nBrown beef with onion and top potatoes with it.\r\nTop with cheese, cover and microwave 1-3 minutes, until cheese melts.\r\n','','4','2006-10-06 08:43:40'),
 ('292','Pea and',null,null,null,'2006-10-06 08:47:05'),
 ('293','Pea and Bacon Side','Run peas under hot water for 1 minute: drain and pat dry.\r\nMix with other recipe ingredients in the order given.\r\nSprinkle with salt and pepper to taste. Chill until ready to serve.\r\n\r\n','','4','2006-10-06 08:47:45'),
 ('294','Pear and Pomegranate Salad','Add all salad ingredients, except nuts, to bowl.\r\nThoroughly combine dressings and toss with salad (amount you like).\r\nTop with nuts.\r\n','*You can buy them or make your own by mixing nuts with 2 Tbsp sugar in warm skillet, stirring constantly, until sugar melts completely. Cool on a plate and break apart.\r\n\r\n','','2006-10-06 08:53:03'),
 ('295','Pizza Ole','Preheat oven to 450°F. \r\nPlace boboli crust on a baking sheet and brush with oil.\r\nSpread salsa over and top with remaining ingredients.\r\nBake 10-12 minutes, until cheese is melted.\r\n','','4','2006-10-06 09:34:07'),
 ('296','Bean Salsa n\' Chips','Mix first 4 ingredients and stir with marinade.\r\nLet sit at least an hour (or more).\r\nServe with chips.\r\n','','6-8','2006-10-06 09:40:48'),
 ('297','Cinnamon Cottage Cheese','Mix cottage cheese and raisins\r\nSprinkle with cinnamon/sugar mix and serve.\r\n','','','2006-10-06 09:48:51'),
 ('298','Braised Chops','Wash and prick potatoes and microwave 4 minutes: chop.\r\nHeat butter in a large, medium hot skillet and add chops.\r\nSprinkle with one-half of the dry dressing and brown chops on one side.\r\nTurn chops over and sprinkle with other half of dressing, top with onion slices.\r\nAdd potatoes to side of skillet and stir-fry so they pick up the glaze.\r\nAdd 1/3 cup water to pan, cover and simmer 3 minutes.\r\n\r\n','','4','2006-10-09 08:32:07'),
 ('299','Hungarian Green Beans','Stir sauce ingredients together and then stir it with beans.\r\nMicrowave 3 minutes, or until beans are hot.\r\n\r\n','','4','2006-10-09 08:40:06'),
 ('300','Spinach Mandarin Salad','Place salad ingredients in a bowl. \r\nShake dressing ingredients in a jar with a tight-fitting lid and toss with salad.	\r\n','','4-6','2006-10-09 08:44:08'),
 ('301','Crunchy Chicken Quesadilla','Cook chicken in a little oil with taco seasoning.\r\nIn blender combine chicken, tomatoes, cheese, avocado, green onions and garlic salt.\r\nSpread about 1/3 cup beans on 5 flour tortillas; top each with tostada shell.  \r\nSpoon tomato mixture over shell\r\nTop with remaining flour tortillas to form 5 quesadilla stacks.\r\nGrill both sides of each stack over medium heat in a large skillet coated with cooking spray, until golden brown.  \r\nCut each into 4 wedges.	\r\n','','6','2006-10-10 21:13:35'),
 ('302','Lemon CB Veggies','Rinse cauliflower and broccoli and  microwave 3-5 minutes until tender.\r\nSimmer olive oil, lemon juice, and garlic 2-3 minutes in a small saucepan. \r\nPut vegetables in a serving dish; pour lemon and garlic sauce on top.\r\nSprinkle with salt and pepper, stir and enjoy!\r\n','','4','2006-10-10 21:23:10'),
 ('303','4-Cheese Mac','Preheat oven to 350 degrees and while pasta cooks:\r\nMelt butter in saucepan; whisk in flour and then milk until thickens.\r\nStir in nutmeg and salt and pepper to taste.\r\nWhisk in gorgonzola and fontina until melted.\r\nRemove from heat and mix with ziti and mozzarella in an 8x8 pan.\r\nSprinkle with parmesan and cook 30 minutes.\r\n	\r\n','','4-6','2006-10-10 21:30:25'),
 ('304','Creamy Butternut Soup','Combine squash and stock in a saucepan; bring to a boil, reduce heat and simmer about 15 minutes until squash is tender.\r\nPuree mixture in a blender and return to saucepan.\r\nOver medium heat cook puree with cream, sour cream, butter, cayenne, sugar, and salt and pepper to taste.\r\nCook until heated through, but not boiling. \r\nTop with chives and serve.\r\n\r\n','','4-6','2006-10-10 21:38:25'),
 ('305','PB and Apples','Spread peanut butter on 8 slices of apple.\r\nSmush these with the remaining 8 slices to make PB apple sandwiches.\r\n\r\n','','4','2006-10-10 21:46:35'),
 ('306','Teriyaki Strip','Mix teriyaki, pepper and garlic: pour over meat so both sides get covered.\r\nCover dish and refrigerate at least 2 hours.\r\nBroil about 10 minutes, turning once.\r\nBaste meat with any remaining marinade right after you turn the meat (do not use marinade after meat is cooked).\r\n','','4','2006-10-10 21:51:22'),
 ('307','Tasty Stuffing with Peas','Preheat oven to 350°F. \r\nPlace butter, soup, milk and onion in a baking dish: microwave covered 1 minute: stir.\r\nAdd peas and cheese, sprinkle with salt and pepper to taste, and stir.\r\nStir melted butter with stuffing: sprinkle this over soup mixture.\r\nBake about 30 minutes, until bubbly. \r\n','','4','2006-10-10 21:55:17'),
 ('308','Dijon Spinach Salad','Combine spinach, tomatoes and cheese in a salad bowl. \r\nPour dressing (amount to taste) over salad and toss.\r\n','','4','2006-10-10 22:02:44'),
 ('309','Quick and Easy Chicken Soup','Put 6 cups water and bouillon in a large pot and bring to a boil.\r\nStir in carrots, celery, onion, garlic, chicken, and spices.\r\nSimmer over medium heat for twenty minutes, stirring occasionally.\r\nRemove chicken, add noodles, and cut chicken into bite-sized pieces.\r\nReturn chicken to soup.\r\nContinue simmering about ten minutes.\r\n','','4','2006-10-10 22:06:32'),
 ('310','Banana Muffin','Mix pancake flour and sugar.\r\nUsing a fork or pastry cutter, mix in the butter.\r\nStir in mashed banana, and three-quarters cup water.\r\nDrop into greased or paper lined muffin cups (6-8): bake about 18 minutes.\r\nServe with your favorite spread and ENJOY!\r\n','','4','2006-10-10 22:19:13'),
 ('311','Cheesy Ham Calzone','Preheat oven to 350 degrees.\r\nIn a hot greased skillet sauté onion, peppers, oregano and garlic 1-2 minutes.\r\nRoll dough out into a quarter-inch thick rectangle and place on cookie sheet. \r\nOn top of the dough layer meat, cheese and sautéed veggies.\r\nRoll dough up lengthwise and brush with melted butter.\r\nBake 20-30 minutes until golden brown.	\r\n','','4-6','2006-10-20 14:50:41'),
 ('312','Sweet and Sour Bean Salad','Place green beans in very hot water for a minute: drain well.\r\nWhisk next 3 ingredients: season with salt and pepper. \r\nAdd all ingredients to preserves mixture: stir well.\r\nCover and refrigerate bean salad at least 6 hours (overnight is good).\r\n','*Make Ahead','4-6','2006-10-20 14:59:41'),
 ('313','Cranberry Mallow','Put sugar, cranberries and ¼ cup water in saucepan: bring to a boil, stirring frequently, until cranberries burst: cool.\r\nChop and core apple, slice banana, and peel and chop orange.\r\nMix fruit pieces with marshmallows and cranberries: fold in whipped cream.\r\n\r\n','','6','2006-10-20 15:05:50'),
 ('314','Thin Batter Fried Sole','In large skillet heat oil over medium high until hot.\r\nMix all batter ingredients well (electric mixer works well).\r\nRinse fillets, pat dry, drag through flour and then dip in batter.\r\nLay fish in skillet and fry about 2-3 minutes each side. \r\n','','4','2006-10-20 15:12:27'),
 ('315','Herbed Rice','Bring 2 cups water to a boil. \r\nPut all ingredients in a bowl and pour the hot water over.\r\nStir, cover and let stand 7-8 minutes.\r\nStir well before serving.\r\n\r\n\r\n','','4','2006-10-20 15:25:31'),
 ('316','Beef Strip Stroganoff','Heat oil in skillet over medium high.\r\nDredge beef strips through flour (use more if needed), and brown in skillet.\r\nPush beef to side and cook onion until soft: stir onion and beef together.\r\nAdd bouillon, lemon, mustard: salt and pepper to taste: stir-fry one minute.\r\nCover meat with water and cook (covered) over low heat for at least 2 hours.\r\nFifteen minutes before meat is done, cook noodles according to package.\r\nFold sour cream into skillet mixture and heat through (do not boil).\r\nServe beef over cooked noodles.\r\n\r\n','* About 2/3 cup sliced fresh mushrooms is a good adder to this dish','4','2006-10-20 17:22:19'),
 ('317','Bits o\' Bacon Cauliflower','Rinse florets and microwave 2-3 minutes, or until almost tender.\r\nChop bacon and add it, the onion, and cauliflower to a skillet over medium high heat (add a little oil if necessary)\r\nSalt and pepper to taste and cook 2 minutes, stirring frequently. \r\nRemove from heat and sprinkle with cheese.\r\n','','4','2006-10-20 17:29:56'),
 ('318','Spinach and Apple Salad','Put spinach and lettuce in salad bowl.\r\nWash and core apple: cut into small pieces and add to salad bowl.\r\nToss dressing with salad.\r\nToast bread: let cool and then spread with olive oil (pantry item) and sprinkle with garlic powder (pantry item): Break in small pieces \r\n','','4','2006-10-20 17:34:39'),
 ('319','Salsa Chicken Breast','Heat oil in skillet over medium high. \r\nSaute garlic one minute: add chicken breasts and sauté 3-4 minutes.\r\nSprinkle chicken with salt and pepper, turn and repeat, and then stir in salsa: cover skillet. Reduce heat and gently simmer 8 minutes (until chicken is no longer pink in the middle).\r\nSprinkle cheese over chicken breasts: cover and continue to simmer 2 minutes until cheese melts. Sprinkle with cilantro and serve.\r\n','','4','2006-10-21 08:59:00'),
 ('320','Bok Choy and Ramen','Wash bok choy and remove bottom 4” of thick stock.\r\nChop finely the remaining stock and leaves, and put into a salad bowl.\r\nChop green onions and add to bok choy. \r\nPut almonds in oven (with fish okay), until browned (about 6-8 minutes).\r\nCrush ramen noodles. Boil 1 cup water and add ramen noodles: let sit 1-2 minutes: Drain and rinse in cold water: add to salad bowl.\r\nShake or stir dressing ingredients together and toss with salad: add browned nuts just before serving.\r\n','','','2006-10-21 09:06:40'),
 ('321','Easiest Peach Muffin','Preheat oven to 375 degrees.\r\nStir all ingredients well and drop into 8 greased holes in a muffin pan.\r\nBake 13-16 minutes, until tops barely begin to brown.\r\nEnjoy with your favorite spread.\r\n\r\n','','4','2006-10-21 09:30:06'),
 ('322','Spaghetti Casserole','Preheat oven to 350 degrees.\r\nBrown hamburger and onion; add sauce, and corn.\r\nPut cooked spaghetti in an 8x8 dish and pour sauce over.\r\nSprinkle cheeses on top and bake 30 minutes.\r\n','','','2006-10-21 09:34:02'),
 ('323','Cherry Tomato Italian Salad','Combine first 5 ingredients in a bowl. \r\nToss with dressing and top with croutons\r\n','*Sliced mushrooms are a good option for this recipe','4','2006-10-21 09:39:57'),
 ('324','Garlic French',null,null,null,'2006-10-21 09:45:34'),
 ('325','Queso Chicken Fajita','Sauté breast strips in medium hot skillet until browned.\r\nAdd onion and peppers to skillet: stir-fry 1-2 minutes.\r\nAdd olives and salsa and simmer while warming tortillas in microwave.\r\nPut chicken/cheese mix on tortillas and roll up. \r\n','','4-6','2006-11-02 08:27:52'),
 ('326','Black Beans and Salsa','Stir beans and salsa together.\r\nSprinkle cheese on top and microwave covered 1 minute (or until hot).\r\n\r\n','','4-6','2006-11-02 08:36:10'),
 ('327','Mango and Papaya','Cut into bite-sized pieces and stir together.','','4-6','2006-11-02 08:39:07'),
 ('328','Candied Meatballs','Preheat oven to 375 degrees F.--*or speed process by using microwave.\r\nBlend well all but meatballs.	\r\nPut frozen meatballs in oven safe dish and evenly spread sauce over. \r\nCook covered for 30 minutes, or until heated through.\r\n','*Or you can cook 5-7 minutes covered in microwave. Oven cooking is best for flavor.','6','2006-11-02 08:44:44'),
 ('329','1000 Island Salad','Cook egg in gently boiling water for 8-10 minutes: peel and chop.\r\nLayer salad ingredients in bowl.\r\nPeel egg and chop fine: stir well with mayo and chili sauce.\r\nAdd dressing to salad and toss just before eating.\r\n','','','2006-11-02 08:49:21'),
 ('330','Baked Potato','Wash potatoes, prick several times and microwave 5-6 minutes until soft.\r\nServe hot potatoes with sour cream, green onions, and salt/pepper to taste.\r\n','','4','2006-11-02 08:53:14'),
 ('331','Swiss Cheese Onion Soup','Peel onion and slice into rings.\r\nMelt butter in saucepan, and sauté onion in butter for 3 minutes.\r\nAdd 4 cups water and all other ingredients to the butter/onion.\r\nBring to a gentle boil.\r\nToast bread and put broken slices in bottom of 4 soup bowls.\r\nCover bread with soup and then sprinkle with salt (optional) and cheese. \r\n','Even kids like it--ENJOY!\r\n\r\n','4','2006-11-02 12:48:29'),
 ('332','Vienna Sausage','Preheat broiler element.\r\nSprinkle bottom of an 8x8 pan (preferably shallow) with brown sugar.\r\nWrap one bacon strip around each sausage (cut part of strip off if too much).\r\nLay sausages in the 8x8 pan and sprinkle lightly with brown sugar.\r\nPlace pan under broiler (8” from element) until bacon is brown and sizzles.\r\nTurn sausages and cook other side until browned. YUM!\r\n','','4','2006-11-03 14:33:48'),
 ('333','Rotini Zucchini Salad','Cook rotini according to package: drain and cool.\r\nAdd all salad ingredients to cooled rotini and stir.\r\nToss dressing with salad.\r\n','*½ cup sliced mushrooms is a good adder','4','2006-11-03 14:41:52'),
 ('334','Creamy Cod with Asparagus','Place cod in an 8X8 dish: cover and microwave 6-8 minutes (until fish flakes).\r\nDrain any liquid off the fish, and then arrange asparagus over the top.\r\nMelt butter and stir in the flour with a wire whisk: then add milk and egg yolk and whisk until all is well blended.\r\nPour sauce over asparagus, and place under broiler (about 6” from element).\r\nBroil 5-7 minutes until top is lightly browned and bubbly. ENJOY!\r\n','','4','2006-11-03 14:50:37'),
 ('335','Rice Pilaf','Melt butter in frying pan, and brown pasta in it stirring occasionally.\r\nAdd onions and sprinkle with salt and pepper: stir-fry half a minute.\r\nAdd 3¼ cups water to pan and bring to a boil.\r\nAdd remaining ingredients, including seasoning pack in soup.\r\nStir and cover: simmer 15-20 minutes until water is absorbed.  ENJOY!\r\n\r\n','','4','2006-11-03 14:56:30'),
 ('336','Chilled Apricots','Mix apricots with cottage cheese and chill.\r\n\r\n\r\n','','4','2006-11-03 15:10:50'),
 ('337','Sirloin Muffin Pizza','Brown beef strips in hot frying pan.\r\nMix soft butter and garlic powder.\r\nLightly toast muffin halves and spread with butter/garlic and spaghetti sauce.\r\nDivide beef onto each muffin and pile on the cheese.\r\nPlace pizza under broiler for 4-5 minutes until cheese melts and muffins hot. \r\n','','4-6','2006-11-03 15:56:46'),
 ('338','Fruit and Nut Salad','Cut  fruit in bite-sized pieces.\r\nStir all dressing ingredients together well and pour over fruit.\r\nSprinkle nuts on top.   ENJOY!\r\n\r\n','','6-8','2006-11-03 20:32:18'),
 ('339','Steamed Garlic Broccoli','Rinse broccoli and microwave 2-3 minutes, or until tender as you like.\r\nStir in butter and garlic salt.\r\n','','4','2006-11-03 20:37:01'),
 ('340','Chicken Fettuccini','Boil chicken until no longer pink in the middle (about 15 minutes) while you cook noodles (in separate pan) according to package directions.\r\nCool chicken by running under cold water: cut into small pieces.\r\nWarm butter, milk, and cream cheese in a saucepan, until all is melted. (Low heat, stirring frequently with wire whisk)\r\nAdd spices, sugar, parmesan and vinegar: heat through, but do not boil.	\r\nStir chicken into sauce and pour over cooked noodles. Delicious!\r\n\r\n\r\n\r\n','','','2006-11-30 08:05:26'),
 ('341','Wilted Cabbage','Place bacon in deep skillet and cook over medium high until evenly brown.\r\nRemove bacon and crumble.\r\nAdd onion and garlic to skillet with a tsp of fat from cooking the bacon.\r\nSauté 1-2 minutes.\r\nAdd vinegar to skillet and bring to a simmer.\r\nAdd cabbage and bacon and sauté 1 minute: Enjoy!\r\n\r\n','','','2006-11-30 08:19:27'),
 ('342','Orange Slice and Grapes','Peel orange and slice in 4 circles.\r\nWash grapes and cut into 4 small clumps.\r\nPlace orange slice on dinner plates and top with grapes.\r\n\r\n','','4','2006-11-30 08:26:36'),
 ('343','Potato Casserole','Preheat oven to 350 degrees F.\r\nWash potatoes, prick several times: microwave 3 minutes (until barely soft).\r\nBrown meat: add onion and stir-fry 1 minute.\r\nPut meat/onion in an 8x8 dish and sprinkle frozen peas over.\r\nAdd potatoes to dish and sprinkle with salt and pepper.\r\nMelt butter and stir into soup: pour over potatoes.\r\nTop with cheese and bake 30 minutes.\r\n','','4','2006-11-30 08:29:11'),
 ('344','Pear and Lime Salad','Core and chop ripe pears into small pieces.\r\nPut dressing ingredients in a bowl with 1Tbsp water: microwave until soft enough to stir (about 30 seconds). \r\nMix dressing with pears. Chill until ready to Enjoy!\r\n','','','2006-11-30 08:43:10'),
 ('345','Turkey Breast','Preheat oven to 325 degrees.\r\nRinse turkey, and sprinkle salt in cavity.\r\nPlace turkey, cavity side down, in roasting pan and spread butter over top.\r\nBake 30 minutes per pound, or according to package directions.\r\nBaste 3 times with juices from bottom as it cooks.\r\nLet meat sit 10-15 minutes before carving—make gravy at this time. \r\nENJOY this simply delicious way to cook turkey!\r\n','','6-8','2006-11-30 08:55:17'),
 ('346','Cherry Berry Jello','Dissolve jello in 1 cup boiling water\r\nAdd cranberry sauce and lemon juice.\r\nPour into lightly greased 8x8 pan and refrigerate until firm.\r\nWhip cream with sugar and cream cheese until well blended: refrigerate.\r\nSpread cream on top of gelatin after it is set, and sprinkle with nuts.\r\n','','6','2006-11-30 09:00:49'),
 ('347','Mashed Potatoes','Wash and cut potatoes into 4ths (peeling is optional)\r\nPut in saucepan and barely cover with water.\r\nBring to a boil: continue boiling until soft (about 20 minutes)\r\nDrain water: add butter, salt, and milk.\r\nMash all with masher, or use electric mixer.\r\n\r\n','','4-6','2006-11-30 09:23:02'),
 ('348','Turkey Gravy','Add packets and 1½ cups water to roasting pan with turkey drippings.\r\nStir with wire whisk until well blended and bubbly.\r\n(Remove grease that sits on top with turkey baster if desired)\r\n\r\n','','','2006-11-30 09:27:51'),
 ('349','Turkey and Stuffing Casserole','Preheat oven to 375 degrees F.\r\nChop turkey and cook in medium hot oiled skillet until barely browned: put in an 8x8 dish.\r\nIn 3 quart saucepan combine three-quarters cup water with butter, bouillon, onion: bring to a boil.\r\nRemove from heat and add stuffing, and then the peas and pimentos.\r\nSprinkle salt and pepper over chicken, and then the stuffing mixture.\r\nBake 22 minutes.   ENJOY!	\r\n\r\n','','4','2006-11-30 09:47:15'),
 ('350','Hot Dressing Salad','Put lettuce in a salad bowl and all other ingredients in small saucepan.\r\nAdd ¼ cup water to contents in saucepan, stir and simmer 2 minutes.\r\nPour hot dressing over lettuce and toss just before serving.\r\n','','4-6','2006-11-30 09:55:46'),
 ('351','Ham and Egg Muffin','Split and toast english muffins (8 halves): spread with butter or mayonnaise.\r\nFry eggs until done like you like them and place each on a muffin half.\r\nFry ham in hot skillet on both sides for 1 minute and lay a slice on each egg.\r\nPut cheese slices on top of ham and top with remaining muffin halves to make 4 sandwiches.\r\n','','4','2006-11-30 10:11:27'),
 ('352','Chili Sauce Dip n\' Veggies','Combine dip ingredients and a little salt.\r\nServe dip with veggies on the side.\r\n','','4-6','2006-11-30 10:19:14'),
 ('353','Cheesecake Berry Banana','Make pudding according to package directions using 1 1/2 cups milk.\r\nStir in berries and banana.\r\nLet salad sit until berries are thawed, then serve or chill.\r\n\r\n','','4-6','2006-11-30 10:24:26'),
 ('354','Broccoli Cheese Soup','Put 1½ cups water in saucepan with broccoli and onion: boil covered 5 minutes.\r\nPut entire contents of pan into a blender and puree.\r\nReturn contents to saucepan: add 1 cup water, bouillon, half & half, and cheese.\r\nMelt butter and whisk in flour: add to pan and cook ON LOW, simmering 15-20 minutes, stirring occasionally. (Bottom burns easily)\r\nSalt and pepper to taste, and ENJOY!\r\n','','4','2006-11-30 10:28:34'),
 ('355','Cucumber Tossed Salad','Toss salad ingredients.\r\nMix dressing ingredients and pour over salad: serve within 15 minutes.\r\n','','6','2006-11-30 10:35:11'),
 ('356','Fast Breadsticks','Preheat oven to 375 degrees F.\r\nUnthaw dough by separating rolls microwaving 2 minutes on DEFROST setting. (Only until thawed)\r\nStretch and twist each roll into an 8” stick: place on greased cookie sheet.\r\nBrush with melted butter, and sprinkle with parmesan and sesame seeds. \r\nBake about 15 minutes, or until browned to your liking.\r\n','','4-6','2006-11-30 10:40:53'),
 ('357','Taco',null,null,null,'2006-11-30 17:17:04'),
 ('358','Taco Chicken Salad','Cut chicken into thin strips (or buy already cut!)\r\nHeat oil in hot skillet and add chicken, chili powder, and salt (to taste).\r\nCook stirring until chicken is no longer pink in the middle, 3-5 minutes.\r\nLet meat cool while you mix ranch dressing with salsa.\r\nPut greens in large bowl: top with chicken, cheese, tomato, and chips.\r\nToss salsa/ranch dressing with salad ingredients.        ENJOY!\r\n','','4-6','2006-11-30 17:17:30'),
 ('359','Pink Stuff','Drain any liquid off the cottage cheese.\r\nStir all ingredients together, and refrigerate until ready to serve.\r\n','','4-6','2006-11-30 17:25:25'),
 ('360','Easy Flat Bread','Combine 1 cup water, butter, and honey: microwave until just boiling.\r\nStir in pancake mix until well blended. \r\nAdd yeast and stir: let sit 10 minutes while oven preheats to 350 degrees.\r\nPut dough in greased loaf pan (or any oven safe dish): Bake 30minutes.\r\nServe slices with butter for the easiest, whole grain bread!\r\n\r\n','','4-6','2006-11-30 17:29:16'),
 ('361','Sweet and Sour Shrimp','Stir sugar and cornstarch together: mix with vinegar and soy.\r\nAdd shrimp to medium hot skillet and stir-fry 1-2 minutes.\r\nAdd soy mixture to skillet: season with salt: cover and simmer 10 minutes.\r\nENJOY over rice and veggies below.\r\n','','4-6','2006-11-30 17:34:14'),
 ('362','Microwave Rice & Veggies','Combine rice, veggies, and 1¼ cups water in microwave safe dish.\r\nCover and cook 5 minutes, until veggies are tender and water absorbed.\r\nLet sit covered 2-3 minutes.	\r\nStir in soy and butter: fluff and ENJOY!\r\n','','4','2006-11-30 17:47:18'),
 ('363','Sliced Pear and Banana','Slice fruits and divide between 4 dinner plates.','','4','2006-11-30 17:51:32'),
 ('364','Potato Chicken Soup','Heat oil in a saucepan: saute onion, carrots, and garlic 5 minutes. \r\nMix flour, oregano, thyme, and sage: sprinkle over veggies: cook 1 minute. \r\nStir in 4-5 cups water, bouillon, raw potato, salt (to taste), and chicken. \r\nBring to a simmer and cook 25 minutes, covered. (Skim top if necessary) \r\nAdd milk and noodles and cook about 8 minutes until noodles are tender. \r\n\r\n\r\n','*Chopped celery is a good addition','','2006-11-30 17:54:14'),
 ('365','Tossed Strawberry Salad','Toss salad ingredients, except nuts, with dressing just before serving.\r\nTop with nuts and enjoy!\r\n','','4-6','2006-11-30 18:09:40'),
 ('366','Appley Glazed Pork','Preheat oven to 350 degrees F.\r\nMix cider, mustard, soy, and sugar until well blender: pour over roast.\r\nBake 70 minutes covered: uncover, bake 30 minutes, basting several times.\r\nLet meat sit 10 minutes before slicing\r\n','Note: Make sure meat is cooked through in the center.','','2006-11-30 18:18:06'),
 ('367','Crispy Spuds','Wash potatoes well, cut in half lengthwise, and place in microwave dish.\r\nMake several slits in cut sides of potatoes and spread oil over slits.\r\nMix cheese with spices and sprinkle evenly over potato halves.\r\nMicrowave on high about 4-5 minutes (until soft when knife is inserted)\r\nHeat broiler and place potatoes 6”under element for 3-4 minutes until brown.\r\n','','','2006-11-30 18:23:02'),
 ('368','Marinated Cherry Tomato','Wash tomatoes and cut in half.\r\nStir other ingredients together and pour over tomatoes, coating each one. Refrigerate until your meal is ready to ENJOY! (1 hour or more) \r\n','','4-6','2006-11-30 18:27:13'),
 ('369','Corned Beef and Cabbage','Put brisket in crock-pot and cover with 5-6 cups water.\r\nWash and cut potatoes into bite-size pieces (peeling optional).\r\nAdd potatoes and carrot to crock pot.\r\nCover and cook on high for 5 hours.\r\nCut meat in pieces (just leave in crock-pot to do this).\r\nAdd cabbage and stir.	\r\nCook covered an additional 20 minutes (on high).\r\n','','8','2006-11-30 18:31:50'),
 ('370','Fruit Salad','Wash and slice the apple into bite sized pieces.\r\nPeel orange and cut in bite-size pieces: wash grapes.\r\nStir all together.\r\n','','4-6','2006-11-30 18:36:42'),
 ('371','Banana Nut Bread','Preheat oven to 350 degrees F.\r\nMix all ingredients well with electric mixer.\r\nPour into a lightly greased loaf pan or small casserole dish.\r\nBake 25 minutes, until toothpick inserted in center comes out clean.\r\nENJOY warm with butter!\r\n\r\n','','4','2006-11-30 18:38:51'),
 ('372','Peppered Salmon','Pour oil in skillet and heat on medium high.\r\nSprinkle pepper to taste (fresh ground preferred) on steaks.\r\nPlace fish, pepper side down in hot oil, and fry until browned.\r\nTurn fish (only do this once), and add onions to skillet.\r\nCook onions 1 minute to the side of the fish.\r\nAdd 2 Tbsp water and the teriyaki sauce to pan and turn heat down.\r\nGently simmer 10-12 minutes covered, until fish flakes.   ENJOY!\r\n','*Note: the salmon may be replaced with boneless/skinless turkey or chicken breasts.','4','2006-12-01 08:12:32'),
 ('373','Wild Rice','Prepare rice according to package directions.\r\nStir rice and sesame seeds and serve hot.\r\n','*To toast—spread seeds on pan and put in pre-heating oven (any temp). Watch closely and stir often until lightly browned.','4','2006-12-01 08:27:02'),
 ('374','Steamed Broccoli','Rinse broccoli and microwave 2-4 minutes, until barely tender (broccoli will continue to cook after removed from microwave)\r\nStir broccoli with butter, and salt/pepper to taste.\r\n','','4','2006-12-01 08:31:36'),
 ('375','Real Mac & Cheese','Preheat oven to 375 degrees.\r\nCook macaroni as directed, and place in casserole dish.\r\nMelt butter: whisk in flour, milk, and salt and pepper to taste.\r\nStir onion and cheese into milk mixture.\r\nPour over macaroni: cover and bake 15 minutes. \r\nUncover and bake 10 minutes more, then let sit 5 minutes. \r\n\r\n\r\n','','4','2006-12-01 08:40:28'),
 ('376','Baked Sweet Potato and Pear','Preheat oven to 375 degrees.\r\nPeel sweet potatoes: prick each one 4-5 times.\r\nMicrowave on high 4-6 minutes (until soft through to center)\r\nCut potatoes into quarter-inch slices, and line bottom of an 8x8 dish.\r\nCore pears: cut into quarter-inch thick slices, and place on top of potatoes.\r\nMelt butter and stir syrup into it.\r\nPour butter/syrup over pears/apples, and bake 20 minutes. (Cook at the same time as Mac & Cheese)\r\nWhile Mac & Cheese sits, put potatoes/pear under broiler about 4 minutes until light brown.   ENJOY!\r\n','','6-8','2006-12-01 08:47:59'),
 ('377','Italian Green Beans','Italian Green Beans\r\n\r\n<ingredients>\r\n15 oz can cut green beans, drained\r\n½ medium red bell pepper\r\n1 packet dry Italian salad dressing\r\n\r\n<instructions>\r\nMake dressing according to package directions, except double the vinegar and use half the amount of oil called for (2 pantry items you should have on hand). \r\nWash and core pepper: cut into thin slices.\r\nMix just 1/3 cup dressing with beans and pepper. \r\nRefrigerate at least 30 minutes (several hours is good).\r\n','','4','2006-12-01 08:55:44'),
 ('378','Game Time Beef Sandwich','Brown beef strips in medium hot skillet.\r\nAdd onion and peppers to meat: stir-fry 2-3 minutes.\r\nStir in cheese and cook until melted.\r\nSlice mushrooms, and cut tomato into bite-sized pieces.\r\nStir these into meat and cook another minute (salt and pepper to taste).\r\nServe on warmed sandwich buns. \r\n','','6','2006-12-01 09:03:41'),
 ('379','7 Layer Dip','Layer all ingredients but chips in the order given.\r\nRefrigerate until ready to serve: dip chips and enjoy!\r\n','','6-8','2006-12-01 09:10:38'),
 ('380','Simply Hearty Chicken Soup','Put two cups water in saucepan with bouillon, carrots, celery, onion, noodles, salt and pepper, and bring to a boil: simmer 10 minutes.\r\nAdd canned soup, milk and chicken. \r\nHeat through and serve.\r\n','','4','2006-12-01 10:36:36'),
 ('381','Toasted Pita Bread','Cut each pita into 6-8 wedges.\r\nLay out on cookie sheet that’s been lightly oiled.\r\nBrush tops of bread with oil and sprinkle with salt.\r\nPut under broiler until quite brown: turn over and brown other side.\r\n','','4','2006-12-01 10:46:37'),
 ('382','Bacon Fried Rice','Prepare rice according to package directions, and let cool with lid off.\r\nFry bacon in deep skillet: remove and crumble.\r\nIn skillet with bacon drippings add egg and lightly scramble, chopping fine.\r\nAdd bacon, onions and rice to the egg: stir-fry in hot fry pan about 3 minutes.\r\nAdd soy and stir. ENJOY sizzling hot!\r\n','*Sliced mushrooms and 1 cup frozen peas and carrots are good additions','4','2006-12-01 10:50:08'),
 ('383','Asian Ginger Salad','Place greens and water chestnuts in salad bowl.\r\nAdd dressing ingredients to jar with tight fitting lid and shake well.\r\nPour dressing over salad: top with chow mein noodles and serve immediately.\r\n\r\n','','4-6','2006-12-01 10:57:00'),
 ('384','Bananas and Oranges','Peel and cut each fruit into bite-sized pieces.\r\nGently stir.	\r\n','(These are fruits eaten in China)','4','2006-12-01 11:06:04'),
 ('385','Fortune Cookie','','Purchase in your international or Chinese section of your grocery store.','','2006-12-01 11:07:23'),
 ('386','Herbed Chicken and Carrots','Pound chicken breasts with meat mallet (or use the edge of a plate)\r\nLay flattened chicken in single layer in glass dish; top with carrots.\r\nMix butter with lemon juice and pour evenly over chicken and carrots.\r\nSprinkle dry Italian dressing over chicken and carrots.\r\nCover and microwave 7 minutes, or until chicken is cooked through.\r\n','','4','2006-12-04 13:17:17'),
 ('387','Spinach Salad','Cook egg in gently boiling water for 10 minutes: cool and chop. \r\nLayer in a bowl or on each plate--spinach, egg, onion, and bacon.\r\nDrizzle with dressing\r\n','','','2006-12-04 13:21:58'),
 ('388','Orange Biscuits','Preheat oven to 425 degrees F.\r\nWash outside of orange: use a grater to scratch a half tsp off the peel.\r\nCut orange in half and squeeze juice until you have one-quarter cup.\r\nStir grated peel, juice, 5 Tbsp water and all other ingredients in a mixing bowl.\r\nDrop spoonfuls of dough onto greased cookie sheet making 5-6 biscuits.\r\nBake 10 minutes. Spread with your favorite buttery spread: ENJOY!\r\n','','4-6','2006-12-04 13:31:38'),
 ('389','Cream of Potato Parsley Soup','Wash potatoes and prick several times: microwave 4 minutes until soft, but firm.\r\nChop potatoes into bite-sized pieces (peeling is optional). Do this under running cold water if potatoes are too hot to handle. \r\nMelt butter in saucepan over low heat.\r\nWhisk in flour, and then salt, sugar, and milk: turn heat up to medium high.\r\nContinue to cook (stir often) until mixture thickens, and barely boils.\r\nAdd potato, parsley and onion. \r\nCook on low heat covered 20-25 minutes, stirring the bottom often! Enjoy!\r\n','','4','2006-12-04 13:44:13'),
 ('390','Lettuce Cheese Salad','Put all salad ingredients in a bowl in the order given.\r\nMix dressing ingredients well and serve on the side with the salad.\r\n','','','2006-12-04 13:58:22'),
 ('391','Ham Rolls','Chop onion fine: mix with cream cheese and onion salt.\r\nDivide and spread cheese mix on each ham slice: roll-up and ENJOY!\r\n','','4-6','2006-12-04 14:04:18'),
 ('392','Spanish Beef Strips','Heat non-stick skillet on stove. When hot add beef and taco seasoning.\r\nStir-fry until brown (5-7 minutes)\r\nAdd 1/3 cup water and honey: Stir.\r\nCover and simmer 5-7 minutes. (Do not overcook!)   ENJOY!\r\n','','4','2006-12-04 15:35:28'),
 ('393','Rice n\' Black Beans','Pour all ingredients into 1 ½ quart microwave dish.\r\nStir and cover. Microwave 6 minutes on full power.\r\nRemove and stir: cover and let sit 5 minutes.  ENJOY!\r\n','','6-8','2006-12-04 15:41:40'),
 ('394','Classic Quiche Lorraine','Bake pie crust according to package directions until almost done.\r\nRemove crust and turn oven down to 325 degrees.\r\nCrumble bacon, and dice onion—set aside.\r\nWith a wire whisk, beat the eggs, cream, milk, flour, and salt together.\r\nAdd bacon, onion, and cheese: Stir.\r\nPour mix into hot pie crust, and bake 45 minutes or until knife inserted \r\nin center comes out clean. \r\nLet stand 5 minutes before serving.\r\n','','6','2006-12-04 16:06:34'),
 ('395','Steamed Veg Medley','Rinse broccoli and cauliflower (do not dry) and mix these with onion.\r\nMicrowave 3-5 minutes until veggies are crisp tender.\r\nStir in butter (or oil, or your favorite spread) and salt and pepper to taste.\r\n','','4-6','2006-12-04 16:31:07'),
 ('396','Cream Cheese Lasagna','Preheat oven to 350 degrees F.\r\nBrown meat in medium hot skillet; add garlic salt and onions.\r\nAdd tomato sauce to skillet: stir and let simmer slowly while you—\r\nStir soft cream cheese and sour cream together.\r\nPut 2 lasagna strips in the bottom of an 8-inch pan. (Do not overlap)\r\nPut half the cream mixture over strips, followed by half the meat. \r\nRepeat--pasta, cream cheese, meat.\r\nTop with parmesan and bake covered 25 minutes.\r\nRemove cover and bake 10 minutes longer: remove and let sit 5 minutes.\r\n','','4','2006-12-04 17:09:23'),
 ('397','Tossed Salad','Put greens in salad bowl and top with tomato and dressing.','','4','2006-12-04 18:53:38'),
 ('398','Sweet Garlic Bread','Preheat broiler\r\nCut loaf of bread lengthwise and butter both halves.\r\nSpread with thin layer of honey.\r\nSprinkle with garlic powder, and spread it around.\r\nPlace halves on flat cooking sheet, 6”under broiler element.\r\nWatch carefully and remove when bread begins to bubble and brown.\r\n','','6-8','2006-12-04 21:44:34'),
 ('399','Ham and Mandarin Salad','Combine salad ingredients in a bowl with ham on top\r\nCombine dressing ingredients and spoon over salad: serve immediately.\r\n\r\n','','4-6','2006-12-19 13:44:32'),
 ('400','Tomato Soup','Blend soup and milk with wire whisk in a saucepan.\r\nAdd diced tomato and pepper: bring to a simmer.\r\nCook, stirring often, 5 minutes.\r\nServe with crackers.\r\n','','4-6','2006-12-19 13:51:17'),
 ('401','Crock-pot Flank Steak','Pierce meat several times with a fork on both sides: lay it in crock-pot. (Cut in pieces if this makes it easier to lay in pot)\r\nMix marinade well with ¾ cup water, and pour over meat.	\r\nCover and cook 2 hours on high; turn down to low and cook another 4 hours.\r\n','','','2006-12-19 13:59:23'),
 ('402','Buttery Noodles','Cook noodles according to package directions.\r\nStir in butter and dry seasoning to taste.\r\n','','','2006-12-19 14:02:08'),
 ('403','Sweet Mixed Berries','Put juices and sugar in medium saucepan and bring to a boil: stir half a minute until sugar is dissolved.\r\nRemove pan from heat and add frozen berries to the liquid: stir and let sit about 5 minutes until fruit is thawed (but still cold). \r\n\r\n','','4-6','2006-12-19 14:09:35'),
 ('404','Crispy Fish','Preheat oven to 400 degrees F.\r\nMelt butter in a pan large enough to lay fish out in a single layer.\r\nPut crushed flakes on a dinner plate or flat surface.\r\nSit fish in milk for a minute: press each piece (both sides) onto cornflakes.\r\nPlace fish in pan with melted butter, in a single layer.\r\nSprinkle with salt and pepper: bake 15-20 minutes until golden brown.\r\n','','4','2006-12-19 14:13:23'),
 ('405','Flavored Rice n\' Green Onion','Melt butter in a heavy nonstick skillet over medium high heat. \r\nSauté onion and celery 3 minutes\r\nStir in rice and sauté 3 minutes, stirring frequently.\r\nStir in one and one-half cups of water, bouillon, and salt and pepper to taste.\r\nBring to a boil, reduce heat, cover and simmer 15-20 minutes until tender.\r\nRemove from heat and let sit covered 5 minutes. Fluff and serve.\r\n','','4','2006-12-19 14:19:20'),
 ('406','Sweet Dressing Romaine','Place lettuce and bacon in a bowl and dressing ingredients in a saucepan.\r\nBring dressing to a boil and simmer about 10 minutes, or until syrupy.\r\nRemove saucepan from heat and add one-fourth cup warm water.\r\nToss lettuce with dressing.\r\n','','','2006-12-19 14:22:40'),
 ('407','Taco Soup','Brown meat with taco seasoning in medium hot skillet.\r\nAdd top 7 ingredients (do not drain) to 3 quart saucepan, and bring to a boil.\r\nSimmer, covered, stirring occasionally, for 15-20 minutes.\r\nIn large soup bowls layer chips, soup, cheese, and sour cream. Yummy!','','6','2006-12-19 14:27:56'),
 ('408','Colorful Skillet Veggies','Melt butter in a saucepan and add remaining ingredients.\r\nSeason with salt and pepper to taste.\r\nCook until skillet ingredients are hot.\r\n','','4-6','2006-12-19 14:46:10'),
 ('409','Apple Pudding Salad','Wire whisk pudding with juice and milk until well stirred: sit in frig.\r\nCut apples into bite-sized pieces and put in a bowl with the grapes.\r\nStir pudding into fruits and ENJOY!\r\n\r\n','','','2006-12-19 14:51:33'),
 ('410','Rigatoni','Preheat oven to 325 degrees F.\r\nCook pasta according to package directions (do not overcook).\r\nBrown pork in medium hot skillet.\r\nAdd garlic to skillet and stir-fry with the meat 1 minute.\r\nAdd tomatoes, basil, and cream to skillet and simmer 2 minutes.\r\nIn an 8x8 pan layer half the sauce, pasta, and cheeses: repeat.\r\nBake covered 30 minutes: remove cover and cook an additional 5 minutes. ENJOY this yummy dish!\r\n','','','2007-01-03 11:08:06'),
 ('411','Italian Tossed Salad','Make dressing according to package (needed ingredients are pantry items).  \r\nPut greens in bowl and top with tomatoes and dressing.       \r\n','','','2007-01-03 11:16:30'),
 ('412','Hot Tuna Salad','Preheat oven to 450 degrees F.\r\nDrain tuna well, and put it in bowl with celery, onion, and cashews.\r\nStir in mayo, and put in casserole dish.\r\nTop with cheese and chips, and bake 10 minutes.\r\n','* Canned chicken or turkey are great substitutions for the tuna','','2007-01-03 11:21:41'),
 ('413','Apples and Peanut Butter','Core and slice apples into eighths\r\nSandwich peanut butter between two pieces so you end up with apple/peanut butter sandwiches.\r\n','','4','2007-01-03 11:32:31'),
 ('414','Swiss Cheese Chicken','Pre-heat oven to 350 degrees.\r\nLay chicken in an 8x8 pan.\r\nCover chicken with cheese slices.\r\nMelt butter, stir the flour in completely with wire whisk, then the bouillon, and then milk—if it’s chunky that’s okay: pour over chicken.\r\nToast bread well and spread lightly with butter: sprinkle with garlic powder.\r\nTear bread into fine pieces: spread over chicken last 15 minutes of baking.\r\nBake 1 hour 15 minutes. (If breasts are thick it may take more time than this)\r\n','','4-6','2007-01-03 11:36:27'),
 ('415','Herbed Brown Rice','Put all ingredients in an oven safe dish with 2½ cups water.\r\nCover and cook in oven along with chicken (at least 1 hour at 350 degrees).\r\nUncover and microwave 5 minutes. Let sit (uncovered) 5 minutes.\r\n\r\n','','4','2007-01-03 11:46:45'),
 ('416','Mediterranean Salad','Put greens and mandarin oranges in salad bowl.\r\nShake all dressing ingredients well in a container with a tight fitting lid.\r\nPour dressing over salad: toss and let sit in frig until ready to eat (5-60 minutes okay).\r\nToss again and ENJOY!\r\n','','4','2007-01-03 11:50:09'),
 ('417','Vegetable Beef Soup','Sear meat in small hot skillet for 3-4 minutes, until very brown on all sides.\r\nPut meat into crock-pot, scraping browned parts from pan.\r\nChop onion: cut celery and potatoes (peeling is optional) into small pieces.\r\nPut vegetables, salt to taste, bouillon, and 5 cups water in crock-pot.\r\nCook 5 hours on high or simmer on top of stove 30-60 minutes.\r\n','','','2007-01-03 11:54:33'),
 ('418','Sour Cream Biscuits','Preheat oven to 450 degrees F.\r\nStir pancake mix, sugar and baking powder.\r\nCut butter into dry mix with pastry cutter or fork until  pea sized.\r\nAdd sour cream and mix well.\r\nDrop by large spoonfuls (6-8) onto baking sheet and cook until golden brown (about 10 minutes)  ENJOY with butter!\r\n','','4','2007-01-03 11:58:09'),
 ('419','Bananas n\' Yogurt','Peel and slice bananas.\r\nMix yogurt and syrup together, and stir with bananas.\r\n	\r\n','','4-6','2007-01-03 12:01:38'),
 ('420','Crockpot BBQ Ribs','Roll ribs in flour and place in crock-pot (or pan for the oven).\r\nMix all other ingredients together and pour over ribs.\r\nCover and cook 6-7 hours on high (crock-pot) or 3 hours (300 degree oven)\r\n\r\n','','4-6','2007-01-03 12:04:12'),
 ('421','Delicious Baked Beans','Mix all ingredients well: cover and bake in oven along with ribs (2-3 hours at 300 degrees) or...\r\nMake the beans when you make rib sauce, and put beans in refrigerator until 10 minutes before eating. Then cover and microwave 5 minutes, uncover and let sit another 5 minutes.','','4','2007-01-03 12:08:10'),
 ('422','Spinach Mushroom Salad','Hard boil eggs, and put in cold water to cool.\r\nChop eggs and mushrooms and add them to spinach.\r\nMix dressing ingredients and toss with salad.\r\n\r\n','','4','2007-01-03 12:11:57'),
 ('423','Italian Onion Patties','Blend beef and dressing together: form into 4 patties.\r\nBrown patties on one side in medium hot skillet.\r\nTurn patties, add onion and continue to fry until meat is cooked through and onions are browned and soft.\r\n','','4','2007-01-03 15:20:29'),
 ('424','French Bread Salad',null,null,null,'2007-01-03 15:23:13'),
 ('425','Seedless Grapes','Wash grapes and put a clump on each plate.	','','','2007-01-03 16:31:45'),
 ('426','Smoked Turkey Croissant','Split croissants in half lengthwise.\r\nCut up turkey breast and add it, the celery, mayo and cranberry sauce to blender or food processor and blend until smooth.\r\nSpread this on the croissants and top with sprouts and salt and pepper.\r\nRefrigerate until ready to serve.\r\n','','4','2007-01-03 16:33:56'),
 ('427','Tangy Potatoes','Prick potatoes several times and microwave 4-6 minutes until barely soft.\r\nRun potatoes under cold water to cool slightly: cut into thin slices (peeling optional).\r\nMicrowave bacon (cut in pieces) and onion together for 1 minute.  \r\nStir vinegar, oil and mustard together; stir this into bacon, onion and potatoes: salt and pepper to taste. Serve warm.\r\n','','4','2007-01-03 16:38:47'),
 ('428','Clam Chowder','Wash and prick potato: microwave 3-5 minutes until barely soft.\r\nDice potato and set aside with onion and celery.\r\nMelt butter in 3 quart saucepan: whisk in flour, salt, and pepper.\r\nCook on medium low heat until bubbly, stirring constantly.\r\nAdd milk: stir and cook until mixture barely bubbles. (Will burn easily so stir often, and keep heat low)\r\nAdd all other ingredients to saucepan (except crackers).\r\nCover and cook 20 minutes on low heat, stirring every few minutes.   ENJOY a family favorite with oyster crackers. \r\n','*Note: One small can chicken breast chunks can be substituted, or just use as delicious potato soup, using 4 cups milk instead of 3½.\r\n\r\n','','2007-01-03 16:53:23'),
 ('429','Lemon Caesar Salad','Put lettuce in salad bowl.\r\nMix dressing, lemon juice, parmesan and pepper.\r\nToss dressing with salad.\r\nAdd croutons just before serving and toss.\r\n','','4','2007-01-03 17:04:01'),
 ('430','Pork Chops','In large, hot skillet brown chops on one side; sprinkle with season salt.\r\nSlice onion in rings and add to pan with pork.\r\nTurn chops and brown on other side, allowing onions to brown also: sprinkle with season salt.\r\nAdd half a cup water to pan: cover and simmer 15-20 minutes until cooked through. (Watch so that pan doesn’t cook dry).\r\nENJOY easy and delicious pork and onions!\r\n','','4','2007-01-03 17:09:05'),
 ('431','Buttery Rice with Peas','Add 2 cups water and first 3 ingredients to saucepan: season to taste.\r\nBring to a boil and then reduce heat to low: cover and simmer 15 minutes.\r\nAdd peas to rice without stirring, cover and simmer 5 minutes, or until liquid is absorbed. Fluff with a fork and ENJOY!\r\n','','4','2007-01-03 17:12:15'),
 ('432','Applesauce',null,null,null,'2007-01-03 17:14:48'),
 ('433','Creamy Parmesan Chicken','Preheat oven to 375 degrees F.\r\nMelt butter in an 8x8 pan.\r\nPound breasts with mallet (or edge of a plate) to flatten.\r\nMix flour with salt and pepper.\r\nRoll each breast in lemon juice, then flour, and put in 8x8 dish with butter.\r\nSlice mushrooms and put with chicken.\r\nPour cream over chicken/mushrooms, and sprinkle with cheese.\r\nBake 45-50 minutes, until chicken is cooked through. ENJOY!\r\n\r\n','','4','2007-01-03 17:16:21'),
 ('434','Swiss Cheese Spinach Salad','Layer salad ingredients in the order listed.\r\nPour dressing over top of salad: refrigerate until your meal is ready.\r\n\r\n','*Mushrooms make a good addition','','2007-01-03 17:23:10'),
 ('435','Ground Beef Stroganoff','Brown ground beef in skillet: add onion and cook 2-3 minutes.\r\nStir in soup, garlic salt and a little pepper (to taste).\r\nSimmer covered 3-5 minutes. (Thin with a little milk or water if necessary)\r\nStir in sour cream: heat through. \r\nServe stroganoff on top of noodles (or rice).\r\n','','4','2007-01-04 07:29:27'),
 ('436','Egg Noodle Pasta','Cook noodles according to package directions.\r\nStir in olive oil and salt.	\r\nTop noodles with Stroganoff and ENJOY!\r\n','','4','2007-01-04 07:34:42'),
 ('437','Greek Salad','Put salad greens, diced tomato, and olives in salad bowl.\r\nSlice onion in rings, and top salad.\r\nShake dressing ingredients, and pour over salad right before serving.\r\n','','6','2007-01-04 07:37:03'),
 ('438','Pepperoni Cheese Calzone','Preheat oven to 350 degrees, F.\r\nSqueeze two biscuits together and flatten into a 4x6 rectangle (about).\r\nPlace on cookie sheet at least 2 inches apart.\r\nPlace one string cheese, 1 Tbsp sauce, and 3-4 pepperoni on each rectangle.\r\nPull long sides up and pinch edges (hard) to close.	\r\nSpread tops with butter and bake 15-18 minutes until browned.\r\n','Note: if calzone opens while baking, just fold it in half with a spatula as soon as it is removed from the oven','4','2007-01-04 07:47:42'),
 ('439','Apricot/Cottage Cheese','Drain apricots well and turn hole side up: fill holes with cottage cheese, and sprinkle with raisins. Chill until ready to serve.\r\n\r\n','','4','2007-01-04 07:57:25'),
 ('440','Steamed Veggies','Rinse veggies and microwave 3-5 minutes until they’re as soft as you like.\r\nStir in butter, salt and pepper.\r\n\r\n','','4','2007-01-04 08:00:07'),
 ('441','Potato Cheese Soup','Wash and cut potatoes into bite-sized pieces (peeling is optional).\r\nDice green onions and bacon.\r\nPut 2½ cups water and first 6 ingredients in large saucepan: bring to a boil, and cover and simmer 5 minutes.\r\nWhisk flour and milk together and add to saucepan with vegetables.\r\nBring to a boil and cook (simmering and stirring bottom occasionally to avoid scorching) 10 minutes.\r\nAdd cheeses and cook stirring until well blended. YUMMY!\r\n','','4','2007-01-04 08:05:04'),
 ('442','Pear-Apple-Orange Salad','Wash and cut fruits into bite-sized pieces.\r\nAdd coconut and stir all ingredients together.\r\n','','4-6','2007-01-04 08:13:32'),
 ('443','Steak Fondue','Melt cheese with orange juice in double boiler (or however you like).\r\nWhile cheese melts, melt butter in skillet and brown steaks on both sides until cooked through: season to taste.\r\nStir cheese sauce well and serve over steaks.\r\n','','4','2007-01-04 08:15:42'),
 ('444','Honey Black Beans n\' Corn','Preheat oven to 375 degrees.\r\nPour hot water over sun-dried tomatoes; let stand until tomatoes are soft, about 10 minutes: drain and coarsely chop.\r\nCombine all ingredients, except cheese, in a casserole dish; sprinkle cheese over top. Bake covered 25 minutes.\r\n','','6','2007-01-04 08:18:04');
insert into `recipes` values('445','Cider Fried Steak','Cut steak into 4 pieces and melt butter in large skillet.\r\nMix flour, salt, and pepper together and put on a dinner plate.\r\nPress steak pieces on flour and put in skillet (reserve extra flour)\r\nBrown in medium hot skillet for 6-8 minutes, turning once.\r\nPour concentrate into skillet: cover and simmer 20 minutes.\r\nRemove meat and cover to keep warm.\r\nStir remaining flour into skillet until thickened, 1 minute: serve on the side.\r\n','','4','2007-01-04 08:38:29'),
 ('446','Herbed Potatoes','Combine cornstarch and one-half cup cold water in a saucepan. \r\nAdd bouillon and bring to a boil stirring well.\r\nAdd all other ingredients, cover and simmer until potatoes are tender (about 20 minutes).\r\n','','4-6','2007-01-04 08:49:06'),
 ('447','Sally\'s Salad','Put peas in very hot water for 1 minute: drain well.\r\nAdd lettuce, peas and swiss to salad bowl.\r\nMix mayo, salad dressing and sugar and stir into lettuce (desired amount).\r\nSprinkle onions on top. Refrigerate until ready to Enjoy!\r\n','','4-6','2007-01-04 08:53:46'),
 ('448','Chicken and Rice Casserole','Preheat oven to 300 degrees.\r\nThoroughly combine first 4 ingredients.\r\nAdd next 4 ingredients to the first and stir well.\r\nMix topping ingredients and sprinkle over casserole.\r\nBake 1 hour.\r\n\r\n','','4-6','2007-01-04 08:58:14'),
 ('449','Orange Bundt Rolls','Coat a bundt pan with nonstick spray and cover bottom with frozen rolls.\r\nMix orange rind and sugar together and sprinkle on top of rolls.\r\nDrizzle butter over the top of that. \r\nCover with plastic wrap (or waxed paper). \r\nLet rise 2-3 hours, or until doubled in size. (In a warm place, just 1 hour)\r\nPreheat oven to 370° degrees.\r\nBake 20 minutes covered and then 10 minutes more uncovered.\r\nRemove from oven and immediately loosen rolls from sides of pan with a knife and invert onto a platter. \r\n','*Make Ahead','12','2007-01-04 09:10:16'),
 ('450','Pork Salad Meal','Mix first four ingredients into a sauce.\r\nPut roast in crock-pot and pour sauce over.\r\nCook on low 8 hours.	\r\nWhile meat cooks last half hour cook rice according to package directions.\r\nShred lettuce, drain beans, and lay a tortilla on a plate, or in a large bowl.\r\nShred meat and on top of tortillas layer rice, beans, meat, lettuce, cheese, and drippings in crock-pot.\r\n\r\n','Note: You can freeze the extra meat, rice, tortillas and cheese for another tasty meal!\r\n','8','2007-01-05 07:32:13'),
 ('451','Apple Slices','Core and slice each apple into several wedges to serve along with your salad meal.','','4','2007-01-05 07:54:48'),
 ('452','Chicken Ranch Pasta','Cut breast strips in thirds and fry in large skillet until no longer pink.\r\nAdd 1½ cups water to skillet, and all other ingredients except pasta.\r\nBring to a boil, and then add pasta.\r\nSimmer covered 5 minutes, and then uncovered 6-8 minutes.\r\n\r\n','','4-6','2007-01-05 08:00:54'),
 ('453','Ambrosia','Drain fruit cocktail and oranges.\r\nPeel and slice banana thin.\r\nAdd all ingredients together and stir.\r\n','','8','2007-01-05 08:10:24'),
 ('454','Sloppy Joes','Chop onion fine.\r\nBrown meat in medium hot skillet: add onion and stir-fry 1 minute.\r\nAdd remaining ingredients (except buns) and stir: simmer 3 minutes.\r\nServe on fresh hamburger buns.\r\n','','4','2007-01-05 11:12:10'),
 ('455','Dill Pickle','Serve on the side of each sloppy joe.','','','2007-01-05 11:34:36'),
 ('456','Broccoli Salad','Place seeds in a dark pan in a preheating oven, or on the stove; stir occasionally until golden brown: cool.\r\nMix mayo, sugar, and 1 tsp water together well, and set aside.\r\nAdd all salad ingredients to bowl: top with dressing and stir. ENJOY!\r\n','','6','2007-01-05 11:36:32'),
 ('457','Baked Halibut and Onion','Preheat oven to 350 degrees, F.\r\nMelt butter and mix with juice and onion.\r\nPlace fish in an 8x8 dish: pour butter mix on top.\r\nSeason (well) the top side of fish with season salt.\r\nBake 30-40 minutes (depending on thickness) Optional: sprinkle with paprika.\r\n','','4','2007-01-05 12:33:09'),
 ('458','Baked Savory Rice','Preheat oven to 350 degrees.\r\nAdd 2 cups boiling water and all ingredients to casserole dish: stir and cover.\r\nBake for 40 minutes (along with the fish) in oven.\r\nENJOY with a little soy sauce (pantry item).\r\n\r\n','','4','2007-01-05 12:41:45'),
 ('459','Lettuce Salad','Toast bread well and cool.\r\nSpread toast with butter and sprinkle with garlic powder: break in pieces.\r\nAdd lettuce and onion to salad bowl: top with bread and serve with dressing.\r\n','','4','2007-01-05 12:57:58'),
 ('460','Country Style Cube Steak','Melt butter in skillet.\r\nMix flour and salt together: dip steaks in it and lay in skillet with butter.\r\nFry meat on both sides 5-6 minutes.\r\nPour 2 cups water into a bowl and stir gravy into it (use a wire whisk).\r\nAdd this to the pan with the meat: cover and simmer 10 minutes.\r\nSprinkle meat (and potatoes) with pepper just before serving.\r\n','','4','2007-01-05 13:14:47'),
 ('461','Red Potatoes','Wash and prick potatoes with a shape knife.\r\nSpread out on a plate, season with salt and microwave 5 minutes.\r\nPut in pan with the meat and gravy the last 5 minutes of cooking time.\r\n\r\n','','4','2007-01-05 13:19:30'),
 ('462','Citrus and Grape Salad','Stir nectar and pudding powder together with wire whisk.\r\nPeel and cut orange into small pieces.\r\nPut grapes and oranges in bowl and stir with nectar. \r\nRefrigerate until ready to serve.\r\n','','4-6','2007-01-05 13:21:12');
